INSERT INTO `objetivo` VALUES (1,'Reconocer que los textos escritos transmiten mensajes y que son escritos por alguien para cumplir un propósito.','LE01 OA 01',1,1,1),(2,'Reconocer que las palabras son unidades de significado separadas por espacios en el texto escrito.','LE01 OA 02',1,1,1),(3,'Identificar los sonidos que componen las palabras (conciencia fonológica), reconociendo, separando y combinando sus fonemas y sílabas.','LE01 OA 03',1,1,1),(4,'Leer palabras aisladas y en contexto, aplicando su conocimiento de la correspondencia letra-sonido en diferentes combinaciones: sílaba directa, indirecta o compleja y dígrafos rr-ll-ch-qu.','LE01 OA 04',1,1,1),(5,'Leer textos breves en voz alta para adquirir fluidez: pronunciando cada palabra con precisión, aunque se autocorrijan en algunas ocasiones; respetando el punto seguido y el punto aparte, y leyendo palabra a palabra.','LE01 OA 05',1,1,1),(6,'Comprender textos aplicando estrategias de comprensión lectora; por ejemplo: relacionar la información del texto con sus experiencias y conocimientos; visualizar lo que describe el texto.','LE01 OA 06',1,1,1),(7,'Leer independientemente y familiarizarse con un amplio repertorio de literatura para aumentar su conocimiento del mundo y desarrollar su imaginación; por ejemplo: poemas, historias breves, textos con una estructura predecible.','LE01 OA 07',1,1,1),(8,'Demostrar comprensión de narraciones que aborden temas que les sean familiares: extrayendo información explícita e implícita; respondiendo preguntas simples, oralmente o por escrito, sobre los textos (qué, quién, dónde, cuándo, por qué); recreando personajes a través de distintas expresiones artísticas, como títeres, dramatizaciones, dibujos o esculturas; describiendo con sus palabras las ilustraciones del texto y relacionándolas con la historia; estableciendo relaciones entre el texto y sus propias experiencias; emitiendo una opinión sobre un aspecto de la lectura.','LE01 OA 08',1,1,1),(9,'Leer habitualmente y disfrutar los mejores poemas de autor y de la tradición oral adecuados a su edad.','LE01 OA 09',1,1,1),(10,'Leer palabras aisladas y en contexto, aplicando su conocimiento de la correspondencia letra-sonido en diferentes combinaciones: sílaba directa, indirecta o compleja y dígrafos rr-ll-ch-qu.','LE01 OA 10',1,1,1),(11,'Desarrollar el gusto por la lectura, explorando libros y sus ilustraciones.','LE01 OA 11',1,1,1),(12,'Asistir habitualmente a la biblioteca para elegir, escuchar, leer y explorar textos de su interés.','LE01 OA 12',1,1,1),(13,'Experimentar con la escritura para comunicar hechos, ideas y sentimientos, entre otros.','LE01 OA 13',1,1,1),(14,'Escribir oraciones completas para transmitir mensajes.','LE01 OA 14',1,1,1),(15,'Escribir con letra clara, separando las palabras con un espacio para que puedan ser leídas por otros con facilidad.','LE01 OA 15',1,1,1),(16,'Incorporar de manera pertinente en la escritura el vocabulario nuevo extraído de textos escuchados o leídos.','LE01 OA 16',1,1,1),(17,'Comprender y disfrutar versiones completas de obras de la literatura, narradas o leídas por un adulto, como: cuentos folclóricos y de autor, poemas, fábulas, leyendas.','LE01 OA 17',1,1,1),(18,'Comprender textos orales (explicaciones, instrucciones, relatos, anécdotas, etc.) para obtener información y desarrollar su curiosidad por el mundo: estableciendo conexiones con sus propias experiencias; visualizando lo que se describe en el texto; formulando preguntas para obtener información adicional y aclarar dudas; respondiendo preguntas abiertas; formulando una opinión sobre lo escuchado.','LE01 OA 18',1,1,1),(19,'Desarrollar la curiosidad por las palabras o expresiones que desconocen y adquirir el hábito de averiguar su significado.','LE01 OA 19',1,1,1),(20,'Disfrutar de la experiencia de asistir a obras de teatro infantiles o representaciones para ampliar sus posibilidades de expresión, desarrollar su creatividad y familiarizarse con el género.','LE01 OA 20',1,1,1),(21,'Participar activamente en conversaciones grupales sobre textos leídos o escuchados en clases o temas de su interés: expresando sus ideas u opiniones, demostrando interés ante lo escuchado y respetando turnos.','LE01 OA 21',1,1,1),(22,'Interactuar de acuerdo con las convenciones sociales en diferentes situaciones: presentarse a sí mismo y a otros, saludar, preguntar, expresar opiniones, sentimientos e ideas; situaciones que requieren el uso de fórmulas de cortesía como por favor, gracias, perdón, permiso.','LE01 OA 22',1,1,1),(23,'Expresarse de manera coherente y articulada sobre temas de su interés: presentando información o narrando un evento relacionado con el tema; incorporando frases descriptivas que ilustren lo dicho; utilizando un vocabulario variado; pronunciando adecuadamente y usando un volumen audible; manteniendo una postura adecuada.','LE01 OA 23',1,1,1),(24,'Incorporar de manera pertinente en sus intervenciones orales el vocabulario nuevo extraído de textos escuchados o leídos.','LE01 OA 24',1,1,1),(25,'Desempeñar diferentes roles para desarrollar su lenguaje y autoestima, y aprender a trabajar en equipo.','LE01 OA 25',1,1,1),(26,'Recitar con entonación y expresión poemas, rimas, canciones, trabalenguas y adivinanzas para fortalecer la confianza en sí mismos, aumentar el vocabulario y desarrollar su capacidad expresiva.','LE01 OA 26',1,1,1),(57,'Leer en voz alta de manera fluida variados textos apropiados a su edad: pronunciando cada palabra con precisión; respetando la coma, el punto y los signos de exclamación e interrogación; leyendo con velocidad adecuada para el nivel.','LE03 OA 01',1,3,1),(58,'Comprender textos aplicando estrategias de comprensión lectora; por ejemplo: relacionar la información del texto con sus experiencias y conocimientos; releer lo que no fue comprendido; visualizar lo que describe el texto; recapitular; formular preguntas sobre lo leído y responderlas; subrayar información relevante en un texto.','LE03 OA 02',1,3,1),(59,'Leer y familiarizarse con un amplio repertorio de literatura para aumentar su conocimiento del mundo y desarrollar su imaginación; por ejemplo: poemas (Unidad 2 y 3), cuentos folclóricos y de autor (Unidad 1, 3 y 4), fábulas (Unidad 2), leyendas (Unidad 1), mitos, novelas (Unidad 4), historietas (Unidad 1), otros.','LE03 OA 03',1,3,1),(60,'Profundizar su comprensión de las narraciones leídas: extrayendo información explícita e implícita; reconstruyendo la secuencia de las acciones en la historia; describiendo a los personajes; describiendo el ambiente en que ocurre la acción; expresando opiniones fundamentadas sobre hechos y situaciones del texto; emitiendo una opinión sobre los personajes.','LE03 OA 04',1,3,1),(61,'Comprender poemas adecuados al nivel e interpretar el lenguaje figurado presente en ellos.','LE03 OA 05',1,3,1),(62,'Leer independientemente y comprender textos no literarios (cartas, biografías, relatos históricos, instrucciones, libros y artículos informativos, noticias, etc.) para ampliar su conocimiento del mundo y formarse una opinión: extrayendo información explícita e implícita; utilizando los organizadores de textos expositivos (títulos, subtítulos, índice y glosario) para encontrar información específica; comprendiendo la información que aportan las ilustraciones, símbolos y pictogramas a un texto; formulando una opinión sobre algún aspecto de la lectura; fundamentando su opinión con información del texto o sus conocimientos previos.','LE03 OA 06',1,3,1),(63,'Desarrollar el gusto por la lectura, leyendo habitualmente diversos textos.','LE03 OA 07',1,3,1),(64,'Asistir habitualmente a la biblioteca para satisfacer diversos propósitos (encontrar información, elegir libros, estudiar o trabajar), cuidando el material en favor del uso común.','LE03 OA 08',1,3,1),(65,'Buscar información sobre un tema en libros, internet, diarios, revistas, enciclopedias, atlas, etc., para llevar a cabo una investigación.','LE03 OA 09',1,3,1),(66,'Determinar el significado de palabras desconocidas, usando claves contextuales o el conocimiento de raíces (morfemas de base), prefijos y sufijos.','LE03 OA 10',1,3,1),(67,'Determinar el significado de palabras desconocidas, usando el orden alfabético para encontrarlas en un diccionario infantil o ilustrado.','LE03 OA 11',1,3,1),(68,'Escribir frecuentemente, para desarrollar la creatividad y expresar sus ideas, textos como poemas, diarios de vida, cuentos, anécdotas, cartas, comentarios sobre sus lecturas, etc.','LE03 OA 12',1,3,1),(69,'Escribir creativamente narraciones (experiencias personales, relatos de hechos, cuentos, etc.) que incluyan: una secuencia lógica de eventos; inicio, desarrollo y desenlace; conectores adecuados.','LE03 OA 13',1,3,1),(70,'Escribir artículos informativos para comunicar información sobre un tema: organizando las ideas en párrafos; desarrollando las ideas mediante información que explica el tema.','LE03 OA 14',1,3,1),(71,'Escribir cartas, instrucciones, afiches, reportes de una experiencia, entre otros, para lograr diferentes propósitos: usando un formato adecuado; transmitiendo el mensaje con claridad.','LE03 OA 15',1,3,1),(72,'Escribir con letra clara para que pueda ser leída por otros con facilidad.','LE03 OA 16',1,3,1),(73,'Planificar la escritura: estableciendo propósito y destinatario; generando ideas a partir de conversaciones, investigaciones, lluvia de ideas u otra estrategia.','LE03 OA 17',1,3,1),(74,'Escribir, revisar y editar sus textos para satisfacer un propósito y transmitir sus ideas con claridad. Durante este proceso: organizan las ideas en párrafos separados con punto aparte; utilizan conectores apropiados; utilizan un vocabulario variado; mejoran la redacción del texto a partir de sugerencias de los pares y el docente; corrigen la ortografía y la presentación.','LE03 OA 18',1,3,1),(75,'Incorporar de manera pertinente en la escritura el vocabulario nuevo extraído de textos escuchados o leídos.','LE03 OA 19',1,3,1),(76,'Comprender la función de lo