n exposiciones orales para comunicar temas de su interés: presentando las ideas de manera coherente y cohesiva; fundamentando sus planteamientos con ejemplos y datos; organizando las ideas en introducción, desarrollo y cierre; usando elementos de cohesión para relacionar cada parte de la exposición; utilizando un vocabulario variado y preciso y un registro formal adecuado a la situación comunicativa; reemplazando algunas construcciones sintácticas familiares por otras más variadas; conjugando correctamente los verbos; utilizando correctamente los participios irregulares; pronunciando claramente y usando un volumen audible, entonación, pausas y énfasis adecuados; usando gestos y posturas acordes a la situación; usando material de apoyo (power point, papelógrafo, objetos, etc.) de manera efectiva; exponiendo sin leer de un texto escrito.','LE06 OA 29',1,6,1),(177,'Incorporar de manera pertinente en sus intervenciones orales el vocabulario nuevo extraído de textos escuchados o leídos.','LE06 OA 30',1,6,1),(178,'Producir textos orales espontáneos o planificados de diverso tipo para desarrollar su capacidad expresiva: poemas; narraciones (contar una historia, describir una actividad, relatar noticias, testimonios, etc.); dramatizaciones.','LE06 OA 31',1,6,1),(179,'Leer habitualmente para aprender y recrearse, y seleccionar textos de acuerdo con sus preferencias y propósitos. ','LE07 OA 01',1,7,1),(180,'Reflexionar sobre las diferentes dimensiones de la experiencia humana, propia y ajena, a partir de la lectura de obras literarias y otros textos que forman parte de nuestras herencias culturales, abordando los temas estipulados para el curso y las obras sugeridas para cada uno.','LE07 OA 02',1,7,1),(181,'Analizar las narraciones leídas para enriquecer su comprensión, considerando, cuando sea pertinente: el o los conflictos de la historia; el papel que juega cada personaje en el conflicto y cómo sus acciones afectan a otros personajes; el efecto de ciertas acciones en el de