ión con el texto en el que están insertos. > Los efectos que puede tener la información divulgada en los hombres o las mujeres aludidos en el texto. ','LE07 OA 09',1,7,1),(188,'Leer y comprender textos no literarios para contextualizar y complementar las lecturas literarias realizadas en clases. ','LE07 OA 10',1,7,1),(189,'Aplicar estrategias de comprensión de acuerdo con sus propósitos de lectura: analizar los distintos tipos de relaciones que establecen las imágenes o el sonido con el texto escrito (en textos multimodales); identificar los elementos del texto que dificultan la comprensión (pérdida de los referentes, vocabulario desconocido, inconsistencias entre la información del texto y los propios conocimientos) y buscar soluciones.','LE07 OA 11',1,7,1),(190,'Expresarse en forma creativa por medio de la escritura de textos de diversos géneros (por ejemplo, cuentos, crónicas, diarios de vida, cartas, poemas, etc.), escogiendo libremente: > El tema. > El género. > El destinatario. ','LE07 OA 12',1,7,1),(191,'Escribir, con el propósito de explicar un tema, textos de diversos géneros (por ejemplo, artículos, informes, reportajes, etc.), caracterizados por: > Una presentación clara del tema. > La presencia de información de distintas fuentes. > La inclusión de hechos, descripciones, ejemplos o explicaciones que desarrollen el tema. > Una progresión temática clara, con especial atención al empleo de recursos anafóricos.  > El uso de imágenes u otros recursos gráficos pertinentes. > Un cierre coherente con las características del género. > El uso de referencias según un formato previamente acordado.','LE07 OA 13',1,7,1),(192,'Escribir, con el propósito de persuadir, textos breves de diversos géneros (por ejemplo, cartas al director, editoriales, críticas literarias, etc.), caracterizados por: la presentación de una afirmación; referida a temas contingentes  o literarios; la presencia de evidencias e información pertinente; la mantención de la coherencia temática.','LE