ncias según un formato previamente acordado. ','LE08 OA 14',1,8,1),(218,' Escribir, con el propósito de persuadir, textos breves de diversos géneros (por ejemplo, cartas al director, editoriales, críticas literarias, etc.), caracterizados por: - La presentación de una afirmación referida a temas contingentes o literarios. - La presencia de evidencias e información pertinente. - La mantención de la coherencia temática.','LE08 OA 15',1,8,1),(219,'Planificar, escribir, revisar, reescribir y editar sus textos en función del contexto, el destinatario y el propósito: - Recopilando información e ideas y organizándolas antes de escribir. - Adecuando el registro, específicamente, el vocabulario (uso de términos técnicos, frases hechas, palabras propias de las redes sociales, términos y expresiones propios del lenguaje hablado), el uso de la persona gramatical, y la estructura del texto al género discursivo, contexto y destinatario. - Incorporando información pertinente. - Asegurando la coherencia y la cohesión del texto. - Cuidando la organización a nivel oracional y textual. - Usando conectores adecuados para unir las secciones que componen el texto y relacionando las ideas dentro de cada párrafo. - Usando un vocabulario variado y preciso. - Reconociendo y corrigiendo usos inadecuados, especialmente de pronombres personales y reflejos, conjugaciones verbales, participios irregulares, y concordancia sujeto–verbo, artículo–sustantivo y sustantivo–adjetivo. - Corrigiendo la ortografía y mejorando la presentación. - Usando eficazmente las herramientas del procesador de textos.','LE08 OA 16',1,8,1),(220,' Usar adecuadamente oraciones complejas: - Manteniendo un referente claro. - Conservando la coherencia temporal. - Ubicando el sujeto, para determinar de qué o quién se habla.','LE08 OA 17',1,8,1),(221,'Construir textos con referencias claras: - Usando recursos de correferencia como deícticos –en particular, pronombres personales tónicos y átonos– y nominalización, sustitución pronominal y elipsis, entre otros. - Analizando si los recursos de correferencia utilizados evitan o contribuyen a la pérdida del referente, cambios de sentido o problemas de estilo','LE08 OA 18',1,8,1),(222,'Conocer los modos verbales, analizar sus usos y seleccionar el más apropiado para lograr un efecto en el lector, especialmente al escribir textos con finalidad persuasiva.','LE08 OA 19',1,8,1),(223,'Escribir correctamente para facilitar la comprensión al lector: - Aplicando todas las reglas de ortografía literal y acentual. - Verificando la escritura de las palabras cuya ortografía no está sujeta a reglas. - Usando correctamente punto, coma, raya y dos puntos. ','LE08 OA 20',1,8,1),(224,'Comprender, comparar y evaluar textos orales y audiovisuales tales como exposiciones, discursos, documentales, noticias, reportajes, etc., considerando: - Su postura personal frente a lo escuchado y argumentos que la sustenten. - Los temas, conceptos o hechos principales. - El contexto en el que se enmarcan los textos. - Prejuicios expresados en los textos. - Una distinción entre los hechos y las opiniones expresados. - Diferentes puntos de vista expresados en los textos. -  Las relaciones que se establecen entre imágenes, texto y sonido. - Relaciones entre lo escuchado y los temas y obras estudiados durante el curso.','LE08 OA 21',1,8,1),(225,'Dialogar constructivamente para debatir o explorar ideas: - Manteniendo el foco. - Demostrando comprensión de lo dicho por el interlocutor. - Fundamentando su postura de manera pertinente. - Formulando preguntas o comentarios que estimulen o hagan avanzar la discusión o profundicen un aspecto del tema. - Negociando acuerdos con los interlocutores. - Reformulando sus comentarios para desarrollarlos mejor. - Considerando al interlocutor para la toma de turnos.','LE08 OA 22',1,8,1),(226,' Expresarse frente a una audiencia de manera clara y adecuada a la situación para comunicar temas de su interés: - Presentando información fidedigna y que denota una investigación previa. - Siguiendo una progresión temática clara. - Recapitulando la información más relevante o más compleja para asegurarse de que la audiencia comprenda. - Usando un vocabulario variado y preciso y evitando el uso de muletillas. - Usando conectores adecuados para hilar la presentación. - Usando material visual que apoye lo dicho y se relacione directamente con lo que se explica.','LE08 OA 23',1,8,1),(227,'Usar conscientemente los elementos que influyen y configuran los textos orales: - Comparando textos orales y escritos para establecer las diferencias, considerando el contexto y el destinatario. - Demostrando dominio de los distintos registros y empleándolos adecuadamente según la situación. - Utilizando estrategias que permiten cuidar la relación con el otro, especialmente al mostrar desacuerdo. - Utilizando un volumen, una velocidad y una dicción adecuados al propósito y a la situación. ','LE08 OA 24',1,8,1),(228,'Realizar investigaciones sobre diversos temas para complementar sus lecturas o responder interrogantes relacionadas con el lenguaje y la literatura: - Delimitando el tema de investigación. - Aplicando criterios para determinar la confiabilidad de las fuentes consultadas. - Usando los organizadores y la estructura textual para encontrar información de manera eficiente. - Evaluando si los textos entregan suficiente información para responder una determinada pregunta o cumplir un propósito. - Descartando fuentes que no aportan a la investigación porque se alejan del tema. - Organizando en categorías la información encontrada en las fuentes investigadas. - Registrando la información bibliográfica de las fuentes consultadas. - Elaborando un texto oral o escrito bien estructurado que comunique sus hallazgos.','LE08 OA 25',1,8,1),(229,'Sintetizar, registrar y ordenar las ideas principales de textos escuchados o leídos para satisfacer propósitos como estudiar, hacer una investigación, recordar detalles, etc.','LE08 OA 26',1,8,1),(230,' Interactuar oralmente con propiedad a través del diálogo en diversas situaciones comunicativas, aportando nuevas ideas, proponiendo acciones, tomando decisiones y valorando esta instancia como una forma de entendimiento con el otro. ','LE1M OA 01',1,9,1),(231,'Valorar la comunicación verbal, no verbal y paraverbal como medio para matizar y enriquecer los sentidos de su propia expresión oral y la de los otros. ','LE1M OA 02',1,9,1),(232,'Producir textos orales de intención literaria y no literarios, bien estructurados y coherentes, para expresarse, narrar, exponer y argumentar, utilizando el registro de habla adecuado y un vocabulario variado y pertinente al tema, a los interlocutores y al contenido. ','LE1M OA 03',1,9,1),(233,'Disfrutar de obras literarias significativas y representativas de diversos géneros y épocas, reconociendo su valor como experiencia de formación y crecimiento personal y contrastándola con las visiones de realidad propias y ajenas. ','LE1M OA 04',1,9,1),(234,'Valorar con actitud crítica la lectura de obras literarias, vinculándolas con otras manifestaciones artísticas, para desarrollar el pensamiento analítico y la reflexión sobre sí mismo y los demás.','LE1M OA 05',1,9,1),(235,'Leer comprensivamente, con diversos propósitos, textos en soportes impresos y electrónicos, con estructuras variadas, integrando variados elementos complejos, que aborden temas de diversos ámbitos.','LE1M OA 06',1,9,1),(236,'Leer comprensivamente, interpretando el sentido global del texto según las posibles perspectivas, evaluando lo leído.','LE1M OA 07',1,9,1),(237,'Interpretar la diversidad de planteamientos y puntos de vista en los mensajes de los medios de comunicación, reconociendo y valorando sus aportes para ampliar las perspectivas y visiones de mundo.','LE1M OA 08',1,9,1),(238,'Producir, en forma manuscrita y digital, textos de intención literaria y no literarios, para expresarse, narrar, describir y exponer, organizando varias ideas o informaciones sobre un tema central, apoyadas por ideas complementarias y marcando con una variedad de recursos las conexiones entre ellas, según contenido, propósito y audiencia. ','LE1M OA 09',1,9,1),(239,'Utilizar adecuadamente un léxico variado, seleccionando de manera precisa palabras, expresiones y terminología de acuerdo con contenido, propósito y audiencia. ','LE1M OA 10',1,9,1),(240,'Escribir utilizando flexiblemente diversos tipos de frases y oraciones de acuerdo con la estructura del texto. ','LE1M OA 11',1,9,1),(241,'Utilizar selectivamente diferentes estrategias de escritura, evaluándolas y modificándolas con el fin de mejorar la calidad de los textos, tomando decisiones sobre su presentación. ','LE1M OA 12',1,9,1),(242,'Valorar la escritura como una actividad creativa y reflexiva de expresión personal, que permite organizar las ideas, presentar información e interactuar con diversas realidades, y como una oportunidad para elaborar conscientemente una visión personal del mundo.','LE1M OA 13',1,9,1),(243,'Interactuar en forma oral con propiedad en diversas situaciones comunicativas, predominantemente expositivas, analizando conceptos y formulando juicios fundamentados, valorando esta instancia como un modo de aprender de otros y de dar a conocer sus ideas.','LE2M OA 01',1,10,1),(244,'Valorar la comunicación verbal, no verbal y paraverbal al plantear una posición, abordar una perspectiva propia y expresarse con eficacia','LE2M OA 02',1,10,1),(245,'Producir textos orales de intención literaria y no literarios, bien estructurados y coherentes, para expresarse, narrar, exponer y argumentar, utilizando el registro de habla adecuado y un vocabulario variado y pertinente al tema, a los interlocutores y al contenido. ','LE2M OA 03',1,10,1),(246,'Disfrutar la lectura de obras literarias de diversas épocas, géneros y culturas relacionadas con temas personales, sociales y culturales y que estimulen su capacidad crítica.','LE2M OA 04',1,10,1),(247,'Valorar con actitud crítica la lectura de obras literarias, vinculándolas con otras manifestaciones artísticas, para desarrollar el pensamiento analítico, la sensibilidad social y la reflexión sobre el entorno cultural y social actual. ','LE2M OA 05',1,10,1),(248,'Leer comprensivamente, con distintos propósitos, textos en soportes impresos y electrónicos, con estructuras variadas, integrando variados elementos complejos, que aborden temas de diversos ámbitos. ','LE2M OA 06',1,10,1),(249,'Leer comprensivamente interpretando el sentido global del texto según las posibles perspectivas, evaluando lo leído. ','LE2M OA 07',1,10,1),(250,'Interpretar en los mensajes de los medios de comunicación, los mundos presentados, identificando elementos que los constituyen y valorando las posibles interpretaciones que de ellos ofrecen.','LE2M OA 08',1,10,1),(251,'Producir, en forma manuscrita y digital, textos de intención literaria y no literarios, para expresarse, narrar, describir, exponer o argumentar, organizando varias ideas o informaciones sobre un tema central, apoyadas por ideas complementarias, y marcando con una variedad de recursos las conexiones entre ellas, según contenido, propósito y audiencia. ','LE2M OA 09',1,10,1),(252,'Utilizar adecuadamente un léxico variado, incorporando algunos usos y matices menos frecuentes de palabras, expresiones y terminología de acuerdo con contenido, propósito y audiencia. ','LE2M OA 10',1,10,1),(253,'scribir textos utilizando flexiblemente diversos tipos de frases y oraciones de acuerdo con la estructura del texto. ','LE2M OA 11',1,10,1),(254,'Utilizar selectivamente diferentes estrategias de escritura, evaluándolas y modificándolas con el fin de mejorar la calidad de los textos, tomando decisiones sobre su presentación.','LE2M OA 12',1,10,1),(255,'Valorar la escritura como una actividad creativa y reflexiva de expresión personal, que permite organizar las ideas, presentar información, interactuar con diversas realidades y como una oportunidad para elaborar conscientemente 