pios, y alcanzando conclusiones luego de la confrontación dialógica.','LE3M OA 05',1,11,1),(261,'Escribir textos expositivosargumentativos, utilizando recursos gramaticales y discursivos, entre otros, los siguientes: > Conectores intraoracionales y relacionantes supraoracionales. > Correferencias léxicas y pronominales. > Verbos actitudinales (saber, creer, pensar, etcétera. > Modalizadores discursivos.','LE3M OA 06',1,11,1),(262,'Planificar y ejecutar una exposición oral, considerando: > Audiencia y contexto. > Interés y pertinencia del tema. > Estructura básica del discurso. > Recursos lingüísticos de carácter cognitivo y expresivo. > Duración de la intervención.','LE3M OA 07',1,11,1),(263,'Reconocer, describir y valorar los recursos de organización temporal como medios para relevar acontecimientos, personajes y temas, en una obra narrativa.','LE3M OA 08',1,11,1),(264,'Reconocer en el ensayo un género específico, diferente del narrativo, en el que los recursos literarios se ponen al servicio del desarrollo libre de ideas y la argumentación. ','LE3M OA 09',1,11,1),(265,'Analizar e interpretar ensayos modernos (siglos XVI a XX) que aborden temas relevantes de la vida personal y social, determinando, entre otros aspectos, los siguientes: > Los temas y su relevancia (pasada y actual). > Las tesis, argumentos y conclusiones. > La forma en que se enlazan temas, tesis, argumentos y conclusiones.','LE3M OA 10',1,11,1),(266,'Con respecto a personajes de obras narrativas, analizar críticamente a partir de: > La estructura psicológica que los caracteriza. > La relación específica entre dos o más personajes. > La forma en que la situación que viven determina sus pensamientos y sus reacciones. > Su evolución a lo largo de la obra.','LE3M OA 11',1,11,1),(267,'Analizar e interpretar obras artísticas y culturales de diversos soportes (afiche, cómic, cortometraje, largometraje, spots publicitarios, fotografía, escultura, pintura, danza, etcétera), profundizando en uno o más de los