ácter reflexivoargumentativo (ensayos, crónicas de opinión, columnas de opinión, etcétera) de autores chilenos y latinoamericanos de los siglos XIX y XX. ','LE4M OA 01',1,12,1),(282,'Identificar, definir y comparar las configuraciones (estructuras) típicas o ideales de los textos expositivosargumentativos, en particular respecto de las secuencias discursivas que incorporan: narrativa, descriptiva, explicativa, dialógica y argumentativa. ','LE4M OA 02',1,12,1),(283,'Analizar, interpretar y comparar novelas de anticipación social distópica. ','LE4M OA 03',1,12,1),(284,'Planificar y ejecutar debates sobre temas polémicos de interés público, considerando: > Una adecuada delimitación del tema en términos de que sea de interés público. > Una investigación previa que permita recolectar información y puntos de vista pertinentes. > Una o más tesis específicas a exponer y defender. > Recursos lingüísticos de carácter cognitivo y expresivo, por ejemplo: metáforas, metonimias, analogías y ejemplificaciones. ','LE4M OA 04',1,12,1),(285,'Comprender y evaluar los argumentos usados por otros durante una presentación oral, un debate, un foro, una mesa redonda o en discusiones usuales de aula.','LE4M OA 05',1,12,1),(286,'Escuchar y analizar un discurso argumentativo dialéctico pronunciado en una situación pública, considerando: > La relevancia personal y social de los temas. > Las tesis y los argumentos que lo sostienen. > Recursos lingüísticos de carácter cognitivo y afectivo. > Recursos kinésicos y proxémicos. > Eventuales recursos y estrategias de retroalimentación y empatía.','LE4M OA 06',1,12,1),(287,'Analizar, interpretar y comparar relatos de perspectivas múltiples (epistolares, collages, entre otros).','LE4M OA 07',1,12,1),(288,'Analizar, interpretar y comparar relatos de narrador omnisciente con focalización interna en uno o más personajes, o bien, de focalización cero.','LE4M OA 08',1,12,1),(289,'Analizar e interpretar obras líricas del siglo XX que aborden el tema del amor y el deseo. ','LE4M OA 09',1,12,1),(290,'Participar activamente en debates, foros, paneles y discusiones usuales de aula, atendiendo a: > La pertinencia de lo que se dice. > El valor de verdad del propio discurso. > Su extensión.','LE4M OA 10',1,12,1),(291,'Escribir textos multimediales que: > Informen sobre un tema de actualidad previamente investigado. > Supongan el empleo adecuado de programas informáticos (procesador de textos, planilla de cálculo, elaborador de gráficos, edición de imágenes visuales). > Integren, al menos, información visual y verbal. > Tengan una estructura no lineal coherente y fácil de seguir. ','LE4M OA 11',1,12,1),(292,'Analizar e interpretar obras literarias que tematicen la vida social y política, problematizando su relación con el contexto histórico de producción, o bien con el de recepción.','LE4M OA 12',1,12,1),(293,'Analizar e interpretar una entrevista de periodismo escrito con rasgos de reportaje de opinión. ','LE4M OA 13',1,12,1),(294,'Analizar, interpretar y evaluar programas radiales y televisivos que se centren en el diálogo y la interacción, tales como programas de charla (talk shows), entrevistas, programas de discusión política y programas de telerrealidad (reality shows). ','LE4M OA 14',1,12,1),(295,'Comprender, analizar e interpretar textos argumentativos de carácter público.','LE4M OA 15',1,12,1),(296,'Comprender, analizar e interpretar obras cinematográficas que supongan un aporte relevante a la cultura. ','LE4M OA 16',1,12,1),(297,'Producir un discurso en situación de comunicación pública fuera del aula, teniendo en cuenta: > La relevancia personal y social de los temas. > Las tesis y los argumentos que las sostienen. > Recursos lingüísticos de carácter cognitivo y afectivo. > Recursos kinésicos y proxémicos. > Recursos y estrategias de retroalimentación y empatía. ','LE4M OA 17',1,12,1),(298,'Analizar, interpretar y comparar obras dramáticas modernas y contemporáneas que aborden el tema de la mujer y su situación dentro de la sociedad. ','LE4M OA 18',1,12,1),(299,'Comprender, analizar e interpretar obras dramáticas modernas y contemporáneas (teatro de los siglos XIX y XX, de postguerra, surrealista, épico, teatro del absurdo, etcétera)','LE4M OA 19',1,12,1),(300,'Analizar e interpretar, comparando y contrastando, dos obras literarias de cualquier época y del mismo o de diferente género, respecto de, por ejemplo, sus temas, personajes, ambientes, registro, uso de figuras literarias y formas de representar la realidad','LE4M OA 20',1,12,1),(301,'Analizar e interpretar comparativamente obras literarias con otras producciones culturales y artísticas, considerando, por ejemplo, los temas, la visión de mundo y las intertextualidades. ','LE4M OA 21',1,12,1),(302,'Comprender y comparar diferentes posturas ideológicas o estéticas en obras literarias y/o cinematográficas específicas.','LE4M OA 22',1,12,1),(303,'Planificar y ejecutar montajes teatrales parciales o totales en forma grupal.','LE4M OA 23',1,12,1),(304,'Nombrar y secuenciar días de la semana y meses del año, utilizando calendarios, e identificar el año en curso.','HI01  OA 01',1,1,3),(305,'Secuenciar acontecimientos y actividades de la vida cotidiana, personal y familiar, utilizando categorías relativas de ubicación temporal, como antes, después; ayer, hoy, mañana; día, noche; este año, el año pasado, el año próximo.','HI01  OA 02',1,1,3),(306,'Registrar y comunicar información sobre elementos que forman parte de su identidad personal (nombre, fecha de nacimiento, lugar de procedencia, ascendencias, gustos, intereses, amigos y otros) para reconocer sus características individuales.','HI01  OA 03',1,1,3),(307,'Obtener y comunicar aspectos de la historia de su familia y sus características, como costumbres, tradiciones, ritos, fiestas, recuerdos y roles que desempeñan los distintos miembros de su grupo familiar, mediante la formulación de preguntas a adultos de su entorno cercano.','HI01  OA 04',1,1,3),(308,'Reconocer los símbolos representativos de Chile (como la bandera, el escudo y el himno nacional), describir costumbres, actividades y la participación de hombres y mujeres respecto de conmemoraciones nacionales (como Fiestas Patrias, Día del Descubrimiento de dos mundos y Combate Naval de Iquique) y reconocer en ellos un elemento de unidad e identidad nacional.','HI01  OA 05',1,1,3),(309,'Conocer expresiones culturales locales y nacionales (como comidas, flores y animales típicos, música y juegos, entre otros), describir fiestas y tradiciones importantes de nivel local (como Fiesta de La Tirana, Fiesta de San Pedro, Fiesta de Cuasimodo, carreras a la chilena, el rodeo, la vendimia y la fundación del pueblo o de la ciudad, entre otras) y reconocer estas expresiones como elementos de unidad e identidad local y/o nacional.','HI01  OA 06',1,1,3),(310,'Conocer sobre la vida de hombres y mujeres que han contribuido a la sociedad chilena en diversos ámbitos; por ejemplo, los fundadores de las ciudades, los exploradores, las personas que han fundado o creado instituciones, las personas que se han destacado por su emprendimiento y su solidaridad, los deportistas, los científicos, los artistas y los grandes poetas, entre otros.','HI01  OA 07',1,1,3),(311,'Reconocer que los mapas y planos son formas de representar lugares.','HI01  OA 08',1,1,3),(312,'Identificar a Chile en mapas, incluyendo la cordillera de los Andes, el océano Pacífico, su región, su capital y su localidad.','HI01  OA 09',1,1,3),(313,'Observar y describir paisajes de su entorno local, utilizando vocabulario geográfico adecuado (país, ciudad, camino, pueblo, construcciones, cordillera, mar, vegetación y desierto) y categorías de ubicación relativa (derecha, izquierda, delante, detrás, entre otros).','HI01  OA 10',1,1,3),(314,'Identificar trabajos y productos de su familia y su localidad y cómo estos aportan a su vida diaria, reconociendo la importancia de todos los trabajos, tanto remunerados como no remunerados.','HI01  OA 11',1,1,3),(315,'Conocer cómo viven otros niños en diferentes partes del mundo por medio de imágenes y relatos, ubicando en un globo terráqueo o mapamundi los países donde habitan, y comparando su idioma, vestimenta, comida, fiestas, costumbres y principales tareas con las de niños chilenos.','HI01  OA 12',1,1,3),(316,'Mostrar actitudes y realizar acciones concretas en su entorno cercano (familia, escuela y comunidad) que reflejen: el respeto al otro (ejemplos: escuchar atentamente al otro, tratar con cortesía a los demás, etc.), la empatía (ejemplos: ayudar a los demás cuando sea necesario, no discriminar a otros por su aspecto o costumbres, etc.), la responsabilidad (ejemplos: asumir encargos en su casa y su sala de clases, cuidar sus pertenencias y las de los demás, cuidar los espacios comunes, etc).','HI01  OA 13',1,1,3),(317,'Explicar y aplicar algunas normas para la buena convivencia y para la seguridad y el autocuidado en su familia, en la escuela y en la vía pública.','HI01  OA 14',1,1,3),(318,'Identificar la labor que cumplen, en beneficio de la comunidad, instituciones como la escuela, la municipalidad, el hospital o la posta, Carabineros de Chile, y las personas que trabajan en ellas.','HI01  OA 15',1,1,3),(319,'Describir los modos de vida de algunos pueblos originarios de Chile en el periodo precolombino, incluyendo ubicación geográfica, medio natural en que habitaban, vida nómada o sedentaria, roles de hombres y mujeres, herramientas y tecnología, principales actividades, vivienda, costumbres, idioma, creencias, alimentación y fiestas, entre otros.','HI02  OA 01',1,2,3),(320,'Comparar el modo de vida y expresiones culturales de algunos pueblos indígenas presentes en Chile actual (como mapuche, aimara o rapa nui) con respecto al periodo precolombino, identificando aspectos de su cultura que se han mantenido hasta el presente y aspectos que han cambiado.','HI02  OA 02',1,2,3),(321,'Distinguir los diversos aportes a la sociedad chilena proveniente de los pueblos originarios (palabras, alimentos, tradiciones, cultura, etc.) y de los españoles (idioma, religión, alimentos, cultura, etc.) y reconocer nuestra sociedad como mestiza.','HI02  OA 03',1,2,3),(322,'Reconocer y dar ejemplos de la influencia y aportes de inmigrantes de distintas naciones europeas, orientales, árabes y latinoamericanas a la diversidad de la sociedad chilena, a lo largo de su historia. ','HI02  OA 04',1,2,3),(323,'Reconocer diversas expresiones del patrimonio cultural del país y de su región, tales como manifestaciones artísticas, tradiciones folclóricas, leyendas y tradiciones orales, costumbres familiares, creencias, idioma, construcciones, comidas típicas, fiestas, monumentos y sitios históricos.','HI02  OA 05',1,2,3),(324,'Leer y dibujar planos simples de su entorno, utilizando puntos de referencia, categorías de posición relativa y simbología pictórica.','HI02  OA 06',1,2,3),(325,'Ubicar Chile, Santiago, la propia región y su capital en el globo terráqueo o en mapas, y describir la ubicación relativa de países limítrofes y de otros países de América del Sur, utilizando los puntos cardinales.','HI02  OA 07',1,2,3),(326,'Clasificar y caracterizar algunos paisajes de Chile según su ubicación en la zona norte, centro y sur del país, observando imágenes, utilizando diversas fuentes y un vocabulario geográfico adecuado (océano, río, cordillera de los Andes y de la Costa, desierto, valle, costa, volcán, archipiélago, isla, fiordo, lago, ciudad y pueblo, entre otros).','HI02  OA 08',1,2,3),(327,'Reconocer diversas expresiones del patrimonio natural de Chile y de su región, como paisajes, flora y fauna característica y parques nacionales, entre otros.','HI02  OA 09',1,2,3),(328,'Ubicar en mapas las zonas habitadas por algunos pueblos originarios de Chile, distinguiendo zonas norte, centro y sur.','HI02  OA 10',1,2,3),(329,'Relacionar las principales características geográficas (disponibilidad de agua, temperatura y vegetación) de las zonas habitadas por algunos pueblos originarios de Chile, con los recursos que utilizaron para satisfacer sus necesidades de alimentación, abrigo y vivienda.','HI02  OA 11',1,2,3),(330,'Mostrar actitudes y realizar acciones concretas en su entorno cercano (familia, escuela y comunidad) que reflejen: respeto al otro (interactuar con cortesía, cuidar espacios comunes, respetar propiedad de los demás); responsabilidad (ejemplos: cumplir con sus deberes escolares, asumir encargos en el hogar y dentro de la sala de clases, etc.); tolerancia (ejemplos: respetar opiniones diversas, no discriminar a otros por su aspecto o costumbres, etc.); empatía (ejemplos: integrar a los demás en sus juegos y actividades, ayudar a los otros, etc.).','HI02  OA 12',1,2,3),(331,'Mantener una conducta honesta en la vida cotidiana, en los juegos y en el trabajo escolar, hablando con la verdad, respetando las reglas de los juegos sin hacer trampa, y reconociendo sus errores y sus acciones, entre otros.','HI02  OA 13',1,2,3),(332,'Conocer, proponer, aplicar y explicar la importancia de algunas normas necesarias para: cuidarse, cuidar a otros y evitar situaciones de riesgo (como seguridad vial, vías de evacuación, adaptaciones para discapacitados, zonas de silencio); organizar un ambiente propicio al aprendizaje y acogedor para todos (por ejemplo, respetar los turnos, cuidar el espacio y las pertenencias comunes y de sus pares, etc.); cuidar el patrimonio y el medioambiente.','HI02  OA 14',1,2,3),(333,'Identificar la labor que cumplen en beneficio de la comunidad servicios como los medios de transporte y de comunicación y el mercado, y algunas instituciones encargadas de proteger nuestro patrimonio cultural y natural.','HI02  OA 15',1,2,3),(334,'Practicar y proponer acciones para cuidar y respetar los espacios públicos dentro y fuera de la escuela (como baños, patios, salas de clase, plazas, parques, playas y calles, entre otros), reconociendo que pertenecen y benefician a todos y que, por lo tanto, su cuidado es responsabilidad de todos los miembros de la comunidad.','HI02  OA 16',1,2,3),(335,'Reconocer aspectos de la vida cotidiana de la civilización griega de la Antigüedad e identificar algunos elementos de su legado a sociedades y culturas del presente; entre ellos, la organización democrática, el desarrollo de la historia, el teatro como forma de expresión, el arte y la escultura, la arquitectura, la mitología, la geometría y la filosofía, la creación del alfabeto y los juegos olímpicos.','HI03  OA 01',1,1,3),(336,'Reconocer aspectos de la vida cotidiana de la civilización romana de la Antigüedad e identificar algunos elementos de su legado a sociedades y culturas del presente; entre ellos, el idioma, el derecho y las leyes, el arte y las obras arquitectónicas.','HI03  OA 02',1,1,3),(337,'Explicar, con ejemplos concretos, cómo diferentes culturas y pueblos (como griegos y romanos de la Antigüedad) han enfrentado de distintas maneras el desafío de desarrollarse y satisfacer las necesidades comunes a todos los seres humanos.','HI03  OA 03',1,1,3),(338,'Comparar modos de vida de la Antigüedad con el propio, considerando costumbres, trabajos y oficios, creencias, vestimentas y características de las ciudades, entre otros.','HI03  OA 04',1,1,3),(339,'Investigar sobre algún tema de su interés con relación a las civilizaciones estudiadas (como los héroes, los dioses, las ciudades, las viviendas, la vestimenta, las herramientas tecnológicas y la esclavitud, entre otros) por medio de diferentes fuentes (libros, fuentes gráficas, TIC) y comunicar lo aprendido.','HI03  OA 05',1,3,3),(340,'Ubicar personas, lugares y elementos en una cuadrícula, utilizando líneas de referencia y puntos cardinales.','HI03  OA 06',1,3,3),(341,'Distinguir hemisferios, círculo del Ecuador, trópicos, polos, continentes y océanos del planeta en mapas y globos terráqueos.','HI03  OA 07',1,3,3),(342,'Identificar y ubicar en mapas las principales zonas climáticas del mundo y dar ejemplos de distintos paisajes que pueden encontrarse en estas zonas y de cómo las personas han elaborado diferentes estrategias para habitarlos.','HI03  OA 08',1,3,3),(343,'Caracterizar el entorno geográfico de las civilizaciones estudiadas, utilizando vocabulario geográfico adecuado (continente, valle, montaña, océano, río, archipiélago, mares, península, ciudad, construcciones y monumentos, entre otros).','HI03  OA 09',1,3,3),(344,'Reconocer algunos factores geográficos que influyeron en el desarrollo de las civilizaciones estudiadas (ubicación, relieve y clima, recursos naturales disponibles, importancia del mar Egeo y sus islas para Grecia e importancia del mar Mediterráneo para Roma, entre otros).','HI03  OA 10',1,3,3),(345,'Asumir sus deberes y responsabilidades como estudiante y en situaciones de la vida cotidiana, como cumplir con sus deberes escolares, colaborar en el orden y en la limpieza de los espacios que comparte con su familia, escuela y comunidad, cuidar sus pertenencias y las de los demás, preocuparse de su salud e higiene y ayudar en su casa.','HI03  OA 11',1,3,3),(346,'Mostrar actitudes y realizar acciones concretas en su entorno cercano (familia, escuela y comunidad) que reflejen valores y virtudes ciudadanas, como: la tolerancia y el respeto al otro (ejemplos: respetar las opiniones distintas distintas a las propias, mostrar disposición al diálogo, respetar expresiones de diversidad, como diferentes costumbres, creencias, origen étnico, nacionalidad, etc.); la empatía (ejemplos: demostrar cortesía con los demás, escuchar al otro, ayudar a quien lo necesite, etc).','HI03  OA 12',1,3,3),(347,'Mantener una conducta honesta en la vida cotidiana, en los juegos y en el trabajo escolar, hablando con la verdad, respetando las reglas de los juegos sin hacer trampa y reconociendo sus errores y sus acciones, entre otros.','HI03  OA 13',1,3,3),(348,'Reconocer que los niños tienen derechos que les permiten recibir un cuidado especial por parte de la sociedad con el fin de que puedan aprender, crecer y desarrollarse, y dar ejemplos de cómo la sociedad les garantiza estos derechos.','HI03  OA 14',1,3,3),(349,'Investigar y comunicar sus resultados sobre algunas instituciones públicas y privadas (como Junaeb, Sernac, SII, BancoEstado, instituciones de previsión y de salud, universidades, Hogar de Cristo y fundaciones, entre otras), identificando el servicio que prestan en la comunidad y los diferentes trabajos que realizan las personas que se desempeñan en ellas.','HI03  OA 15',1,3,3),(350,'Participar responsable y activamente en su hogar (encargos, celebraciones, cuidado de las cosas) y en la escuela (campañas solidarias, celebraciones, deportes y juegos), cumpliendo compromisos y responsabilidades adquiridos.','HI03  OA 16',1,3,3),(351,'Describir la civilización maya, considerando ubicación geográfica, organización política, actividades económicas, formas de cultivo y alimentos, organización de la sociedad, roles y oficios de hombres y mujeres, religión y ritos, desarrollo de la astronomía y la matemática, sistemas de escritura, guerras y sacrificios humanos, construcciones, costumbres y vida cotidiana, entre otros.','HI04  OA 01',1,4,3),(352,'Describir la civilización azteca, considerando ubicación geográfica, organización política y extensión, la ciudad de Tenochtitlán, formas de cultivo y alimentos, religión y ritos, avances tecnológicos, organización de la sociedad, roles y oficios de hombres y mujeres, construcciones, costumbres y vida cotidiana, entre otros.','HI04  OA 02',1,4,3),(353,'Describir la civilización inca, considerando ubicación geográfica, organización política, sistema de caminos y correos, religión y ritos, avances tecnológicos, organización de la sociedad, roles y oficios de hombres y mujeres, formas de cultivo y alimentos, construcciones, costumbres y vida cotidiana, entre otros.','HI04  OA 03',1,4,3),(354,'Analizar y comparar las principales características de las civilizaciones americanas (mayas, aztecas e incas).','HI04  OA 04',1,4,3),(355,'Investigar en diversas fuentes (imágenes, medios audiovisuales, TICs, gráficos, textos y otras) sobre algunos temas relacionados con el presente de los pueblos indígenas americanos; por ejemplo, el protagonismo que tienen hoy, la influencia de las civilizaciones maya, azteca e inca sobre la cultura y la sociedad de los países actuales, situados donde ellos se desarrollaron, y su influencia en las comidas y en la lengua que empleamos en la actualidad, entre otros.','HI04  OA 05',1,4,3),(356,'Investigar en diversas fuentes (imágenes, medios audiovisuales, TICs, gráficos, textos y otras) sobre algunos temas relacionados con el presente de los pueblos indígenas americanos; por ejemplo, el protagonismo que tienen hoy, la influencia de las civilizaciones maya, azteca e inca sobre la cultura y la sociedad de los países actuales, situados donde ellos se desarrollaron, y su influencia en las comidas y en la lengua que empleamos en la actualidad, entre otros.','HI04  OA 06',1,4,3),(357,'Ubicar lugares en un mapa, utilizando coordenadas geográficas como referencia (paralelos y meridianos).','HI04  OA 07',1,4,3),(358,'Distinguir recursos naturales renovables y no renovables, reconocer el carácter limitado de los recursos naturales y la necesidad de cuidarlos, e identificar recursos presentes en objetos y bienes cotidianos.','HI04  OA 08',1,4,3),(359,'Describir distintos paisajes del continente americano, considerando climas, ríos, población, idiomas, países y grandes ciudades, entre otros, y utilizando vocabulario geográfico adecuado.','HI04  OA 09',1,4,3),(360,'Reconocer y ubicar los principales recursos naturales de América, considerando su distribución geográfica, su uso, y la importancia de cuidarlos en el marco de un desarrollo sostenible.','HI04  OA 10',1,4,3),(361,'Comparar, mediante la observación en imágenes, mapas y otras fuentes, paisajes de su región con paisajes de América, distinguiendo distintas formas de adaptación y transformación de la población a su ambiente natural.','HI04  OA 11',1,4,3),(362,'Distinguir algunos actores de la organización política y democrática de Chile, como Presidente, ministros, senadores, diputados y alcaldes, considerando las instituciones en las que ejercen y cómo son nombrados o elegidos.','HI04  OA 12',1,4,3),(363,'Reconocer sus principales derechos en situaciones de la vida cotidiana, como el derecho a la educación, a contar con alimentación, vivienda, recreo y servicios médicos adecuados, a expresarse, a ser protegido contra el abandono y la crueldad, y a no trabajar antes de la edad apropiada; y dar ejemplos de cómo se pueden ejercer y proteger esos derechos.','HI04  OA 13',1,4,3),(364,'Mantener una conducta honesta en la vida cotidiana, en los juegos y en el trabajo escolar, hablando con la verdad, respetando las reglas de los juegos sin hacer trampa, evitando la copia y el plagio y reconociendo sus errores y sus acciones, entre otros.','HI04  OA 14',1,4,3),(365,'Demostrar respeto por todas las personas mediante acciones en su vida diaria, sin discriminar por condiciones físicas, sociales, económicas, étnicas o culturales.','HI04  OA 15',1,4,3),(366,'Participar en su comunidad, tomando parte en elecciones para una directiva del curso, asignando roles y funciones a cada cargo, y considerando la importancia de mantener una buena convivencia y una organización del curso que favorezca el trabajo escolar.','HI04  OA 16',1,4,3),(367,'Resolver conflictos, aplicando estrategias como determinar la causa del problema, proponer posibles soluciones, dialogar, buscar un punto de vista común y votar, entre otras, demostrando respeto y empatía por las partes involucradas para mejorar la convivencia en el curso y en la comunidad escolar.','HI04  OA 17',1,4,3),(368,'Diseñar y participar activamente en un proyecto grupal que solucione un problema de la comunidad escolar; por ejemplo, reciclaje de la basura, exceso de ruido, organización de turnos, leer o entretener a alumnos más pequeños, etc.','HI04  OA 18',1,4,3),(369,'Opinar y argumentar con fundamentos sobre temas de la asignatura u otros.','HI04  OA 19',1,4,3),(370,'Explicar los viajes de descubrimiento de Cristóbal Colón, de Hernando de Magallanes y de algún otro explorador, considerando sus objetivos, las rutas recorridas, los avances tecnológicos que facilitaron la navegación, las dificultades y los desafíos que enfrentaron las tripulaciones y el contexto europeo general en que se desarrollaron.','HI05  OA 01',1,5,3),(371,'Describir el proceso de conquista de América y de Chile, incluyendo a los principales actores (Corona española, Iglesia católica y hombres y mujeres protagonistas, entre otros), algunas expediciones y conflictos bélicos, y la fundación de ciudades como expresión de la voluntad de los españoles de quedarse y expandirse, y reconocer en este proceso el surgimiento de una nueva sociedad.','HI05  OA 02',1,5,3),(372,'Analizar el impacto y las consecuencias que tuvo el proceso de conquista para Europa y para América, considerando diversos ámbitos.','HI05  OA 03',1,5,3),(373,'Investigar sobre los efectos de la conquista sobre los pueblos indígenas americanos, utilizando fuentes dadas por el docente.','HI05  OA 04',1,5,3),(374,'Describir algunas dimensiones de la vida colonial en Chile, como organización de la sociedad y grupos sociales, oficios y actividades económicas, costumbres y vida cotidiana, arte y celebraciones.','HI05  OA 05',1,5,3),(375,'Explicar aspectos centrales de la Colonia, como la dependencia de las colonias americanas de la metrópoli, el rol de la Iglesia católica y el surgimiento de una sociedad mestiza.','HI05  OA 06',1,5,3),(376,'Explicar y dar ejemplos de las distintas formas en las que españoles y mapuches se relacionaron en el período colonial, considerando resistencia mapuche y guerra de Arauco, mestizaje, formas de trabajo (como encomienda y esclavitud), evangelización, vida fronteriza y sistema de parlamentos.','HI05  OA 07',1,5,3),(377,'Identificar, en su entorno o en fotografías, elementos del patrimonio colonial de Chile que siguen presentes hoy, como edificios, obras de arte y costumbres, entre otros.','HI05  OA 08',1,5,3),(378,'Caracterizar las grandes zonas de Chile y sus paisajes (Norte Grande, Norte Chico, Zona Central, Zona Sur y Zona Austral), considerando ubicación, clima (temperatura y precipitaciones), relieve, hidrografía, población y recursos naturales, entre otros.','HI05  OA 09',1,5,3),(379,'Reconocer y ubicar en mapas recursos naturales significativos de Chile, como cobre, hierro, recursos marítimos y forestales, entre otros; diferenciar recursos renovables y no renovables y explicar la importancia de cuidarlos en el marco de un desarrollo sostenible.','HI05  OA 10',1,5,3),(380,'Analizar y dar ejemplos de diversas maneras en las que el trabajo de las personas, sus ideas y proyectos potencian y dan valor a los recursos naturales (por ejemplo: tecnología de riego, elaboración de vinos, uso de madera en la construcción, nuevas formas de explotación sustentable).','HI05  OA 11',1,5,3),(381,'Investigar, describir y ubicarlos riesgos naturales que afectan a su localidad, como sismos, maremotos, inundaciones, derrumbes y volcanismo, e identificar formas en que la comunidad puede protegerse (construcciones antisísmicas, medidas de seguridad y evacuación en el hogar, en la escuela y en los distintos espacios públicos, entre otros).','HI05  OA 12',1,5,3),(382,'Reconocer que todas las personas son sujetos de derecho, que deben ser respetados por los pares, la comunidad y el Estado, y que esos derechos no dependen de características individuales, como etnia, sexo, lugar de nacimiento u otras.','HI05  OA 13',1,5,3),(383,'Reconocer que los derechos generan deberes y responsabilidades en las personas y en el Estado, lo que, por ejemplo, se manifiesta en que: las personas deben respetar los derechos de los demás; todas las personas deben respetar las leyes; el Estado debe asegurar que las personas puedan ejercer sus derechos (a la educación, a la protección de la salud, a la libertad de expresión, a la propiedad privada y a la igualdad ante la ley, entre otros); el Estado debe asegurar los derechos de las personas a participar en la vida pública, como el derecho a formar organizaciones de participación social (fundaciones, juntas de vecinos, etc.), a participar en partidos políticos y el derecho a sufragio, entre otros.','HI05  OA 14',1,5,3),(384,'Reconocer que hay logros y beneficios que dependen del esfuerzo, el mérito y el comportamiento de cada persona (como las calificaciones, los premios deportivos, los premios por compañerismo, el aprecio y el reconocimiento por parte de sus pares, liderazgo).','HI05  OA 15',1,5,3),(385,'Demostrar actitudes cívicas con acciones en su vida diaria, como: actuar con honestidad y responsabilidad (ejemplos: respetar los acuerdos establecidos, respetar la autoría de música y películas, evitar el plagio escolar, etc.); respetar a todas las personas (ejemplos: no discriminar por condiciones físicas, sociales, culturales o étnicas, escuchar respetuosamente opiniones distintas, respetar espacios y propiedad de los demás, etc.); contribuir a la buena convivencia (ejemplos: buscar soluciones pacíficas para resolver problemas, mostrar empatía con los demás, etc.); cuidar y valorar el patrimonio y el medioambiente (ejemplos: realizar campañas de información y cuidado de nuestro patrimonio, usar la energía de manera eficiente, etc.).','HI05  OA 16',1,5,3),(386,'Participaren su comunidad, tomando parte en elecciones para una directiva de curso, asignando roles y funciones a cada cargo, y demostrando que entienden las responsabilidades que lleva consigo el desempeño de un cargo y la importancia de elegir personas que se estimen idóneas, para mantener una buena convivencia y una organización del curso que permita el trabajo escolar.','HI05  OA 17',1,5,3),(387,'Diseñar y participar en un proyecto que solucione un problema de la comunidad escolar, considerando temas como voluntariado, gasto excesivo de agua y electricidad en la escuela, y cuidado del medioambiente, entre otros, y ateniéndose a un plan y a un presupuesto.','HI05  OA 18',1,5,3),(388,'Explicar formas en que un grupo de personas puede organizarse para resolver problemas, mejorar su calidad de vida y la de otros y lograr metas comunes; por ejemplo, fundaciones, voluntariado, empresas, agrupaciones y recolección de fondos para causas benéficas.','HI05  OA 19',1,5,3),(389,'Opinar y argumentar con fundamentos sobre temas de la asignatura u otros.','HI05  OA 20',1,5,3),(390,'Evaluar posibles soluciones frente a un problema o proyecto y justificar su elección.','HI05  OA 21',1,5,3),(391,'Informarse y opinar sobre temas relevantes y de su interés en el país y el mundo (política, medioambiente, deporte, arte y música, entre otros) por medio de periódicos y TlC.','HI05  OA 22',1,5,3),(392,'Explicar los múltiples antecedentes de la independencia de las colonias americanas y reconocer que la independencia de Chile se enmarca en un proceso continental.','HI06  OA 01',1,6,3),(393,'Explicar el desarrollo del proceso de independencia de Chile, considerando actores y bandos que se enfrentaron, hombres y mujeres destacados, avances y retrocesos de la causa patriota y algunos acontecimientos significativos, como la celebración del cabildo abierto de 1810 y la formación de la Primera Junta Nacional de Gobierno, la elección del primer Congreso Nacional, las batallas de Rancagua, Chacabuco y Maipú, y la Declaración de la Independencia, entre otros.','HI06  OA 02',1,6,3),(394,'Describir algunos hitos y procesos de la organización de la república, incluyendo las dificultades y los desafíos que implicó organizar en Chile una nueva forma de gobierno, el surgimiento de grupos con diferentes ideas políticas (conservadores y liberales), las características de la Constitución de 1833 y el impacto de las reformas realizadas por los liberales en la segunda mitad del siglo XIX.','HI06  OA 03',1,6,3),(395,'Investigar sobre algunos aspectos culturales del siglo XIX, como los avances en educación y la fundación de instituciones, el aporte de intelectuales y científicos nacionales (por ejemplo, Diego Barros Arana, Benjamín Vicuña Mackenna, José Victorino Lastarria) y extranjeros (por ejemplo, Andrés Bello, Claudio Gay, Charles Darwin y María Graham), las primeras mujeres en obtener títulos universitarios y el impacto en la sociedad de la llegada del ferrocarril y de otros avances tecnológicos, entre otros.','HI06  OA 04',1,6,3),(396,'Describir cómo se conformó el territorio de Chile durante el siglo XIX, considerando colonizaciones europeas, la incorporación de Isla de Pascua, la ocupación de la Araucanía, la Guerra del Pacífico y diversos conflictos bélicos, entre otros factores.','HI06  OA 05',1,6,3),(397,'Caracterizar los principales aspectos que definieron el período de riqueza aportada por la explotación del salitre, considerando la expansión económica y el inicio de la \"cuestión social\".','HI06  OA 06',1,6,3),(398,'Explicar y dar ejemplos de la progresiva democratización de la sociedad durante el siglo XX, considerando el acceso creciente al voto, la participación de la mujer en la vida pública y el acceso a la educación y a la cultura, entre otros.','HI06  OA 07',1,6,3),(399,'Comparar diferentes visiones sobre el quiebre de la democracia en Chile, el régimen o dictadura militar y el proceso de recuperación de la democracia a fines del siglo XX, considerando los distintos actores, experiencias y puntos de vista, y el consenso actual con respecto al valor de la democracia.','HI06  OA 08',1,6,3),(400,'Explicar y dar ejemplos de aspectos que se mantienen y aspectos que han cambiado o se han desarrollado en la sociedad chilena a lo largo de su historia.','HI06  OA 09',1,6,3),(401,'Identificar elementos constitutivos del territorio nacional, considerando la localización de Chile en el mundo y su carácter tricontinental.','HI06  OA 10',1,6,3),(402,'Caracterizar geográficamente las regiones político-administrativas del país, destacando los rasgos físicos (como clima, relieve, hidrografía y vegetación) y humanos (como volumen y distribución de la población y actividades económicas) que les dan unidad.','HI06  OA 11',1,6,3),(403,'Comparar diversos ambientes naturales en Chile (desértico, altiplánico, costero, mediterráneo, andino, frío y lluvioso, patagónico y polar), considerando como criterios las oportunidades y las dificultades que presentan y cómo las personas las han aprovechado y superado para vivir y desarrollarse.','HI06  OA 12',1,6,3),(404,'Explicar las principales características físicas, humanas y económicas de su región y de su localidad.','HI06  OA 13',1,6,3),(405,'Explicar cómo han influido los desastres naturales en el desarrollo de Chile durante su historia reciente, dando ejemplos de nivel nacional y regional (sismos, volcanismo, sequía, inundaciones y derrumbes, entre otros).','HI06  OA 14',1,6,3),(406,'Explicar algunos elementos fundamentales de la organización democrática de Chile, incluyendo: la división de poderes del Estado; la representación mediante cargos de elección popular (concejales, alcaldes, diputados, senadores y Presidente); la importancia de la participación ciudadana.','HI06  OA 15',1,6,3),(407,'Reconocer que la Constitución Política de Chile establece la organización política del país y garantiza los derechos y las libertades de las personas, instaurando un sistema democrático.','HI06  OA 16',1,6,3),(408,'Comprender que todas las personas tienen derechos que deben ser respetados por los pares, la comunidad y el Estado, lo que constituye la base para vivir en una sociedad justa, y dar como ejemplo algunos artículos de la Constitución y de la Declaración Universal de los Derechos Humanos.','HI06  OA 17',1,6,3),(409,'Explicar que los derechos generan deberes y responsabilidades en las personas e instituciones, y lo importante que es cumplirlos para la convivencia social y el bien común.','HI06  OA 18',1,6,3),(410,'Proponer y fundamentar distintas formas en que la sociedad puede proteger a las personas de situaciones en las que no se respetan sus derechos.','HI06  OA 19',1,6,3),(411,'Demostrar actitudes cívicas con acciones en su vida diaria, como: respetar a todas las personas (ejemplos: actuar considerando la igualdad de derechos, escuchar respetuosamente opiniones distintas, etc.); contribuir a la buena convivencia (ejemplos: proponer posibles soluciones frente a un problema, usar el diálogo para plantear ideas a sus pares, alcanzar acuerdos, cooperar activamente en el logro de metas comunes, etc.); actuar con honestidad y responsabilidad (ejemplos: hablar con la verdad, actuar de acuerdo a sus convicciones y de las responsabilidades que se deriven, cumplir las responsabilidades asumidas, evitar la copia textual y el plagio, etc.); cuidar y valorar el patrimonio y el medioambiente (ejemplos: impulsar y participar en campañas de reciclaje, realizar acciones en la casa y en la escuela para ahorrar luz, agua y gas, etc.).','HI06  OA 20',1,6,3),(412,'Trabajar en equipo de manera efectiva para llevar a cabo una investigación u otro proyecto, asignando y asumiendo roles, cumpliendo las responsabilidades asignadas y los tiempos acordados, escuchando los argumentos de los demás, manifestando opiniones fundamentadas y llegando a un punto de vista común.','HI06  OA 21',1,6,3),(413,'Participar en su comunidad, tomando parte en elecciones para una directiva de curso, evaluando las propuestas realizadas por los diferentes aspirantes y considerando la importancia de elegir personas responsables.','HI06  OA 22',1,6,3),(414,'Participar, mediante acciones concretas, en proyectos que impliquen aportes dentro de la escuela, la comunidad y la sociedad, como voluntariado y ayuda social, entre otros, ateniéndose a un plan y un presupuesto.','HI06  OA 23',1,6,3),(415,'Opinar y argumentar con fundamentos sobre temas de la asignatura u otros.','HI06  OA 24',1,6,3),(416,'Evaluar posibles soluciones frente a un problema o proyecto y justificar su elección.','HI06  OA 25',1,6,3),(417,'Informarse y opinar sobre temas relevantes y de su interés en el país y el mundo (política, medioambiente, deporte, arte y música, entre otros) por medio de periódicos y TlCs.','HI06  OA 26',1,6,3),(418,'Explicar el proceso de hominización, reconociendo las principales etapas de la evolución de la especie humana, la influencia de factores geográficos, su dispersión en el planeta y las distintas teorías del poblamiento americano. ','HI07  OA 01',1,7,3),(419,'Explicar que el surgimiento de la agricultura, la domesticación de animales, la sedentarización, la acumulación de bienes y el desarrollo del comercio, fueron procesos de larga duración que revolucionaron la forma en que los seres humanos se relacionaron con el espacio geográfico. ','HI07  OA 02',1,7,3),(420,'Explicar que en las primeras civilizaciones la formación de estados organizados y el ejercicio del poder estuvieron marcados por la centralización de la administración, la organización en torno a ciudades, la estratificación social, la formación de sistemas religiosos y el desarrollo de técnicas de contabilidad y escritura.','HI07  OA 03',1,7,3),(421,'Caracterizar el surgimiento de las primeras civilizaciones (por ejemplo, sumeria, egipcia, china, india, minoica, fenicia, olmeca y chavín, entre otras), reconociendo que procesos similares se desarrollaron en distintos lugares y tiempos. ','HI07  OA 04',1,7,3),(422,'Caracterizar el mar Mediterráneo como ecúmene y como espacio de circulación e intercambio, e inferir cómo sus características geográficas (por ejemplo, clima, relieve, recursos naturales, entre otros) influyeron en el desarrollo de la ciudad Estado griega y de la república romana. ','HI07  OA 05',1,7,3),(423,'Analizar las principales características de la democracia en Atenas, considerando el contraste con otras formas de gobierno del mundo antiguo, y su importancia para el desarrollo de la vida política actual y el reconocimiento de los derechos de los ciudadanos.','HI07  OA 06',1,7,3),(424,'Relacionar las principales características de la civilización romana (derecho, organización burocrática y militar, infraestructura, esclavitud, entre otros) con la extensión territorial de su Imperio, la relación con los pueblos conquistados, el proceso de romanización y la posterior expansión del cristianismo. ','HI07  OA 07',1,7,3),(425,'Analizar, apoyándose en fuentes, el canon cultural que se constituyó en la Antigüedad clásica, considerando la centralidad del ser humano y la influencia de esta cultura en diversos aspectos de las sociedades del presente (por ejemplo, escritura alfabética, filosofía, ciencias, historia, noción de sujeto de derecho, relaciones de género, ideal de belleza, deporte, teatro, poesía y artes, entre otros).','HI07  OA 08',1,7,3),(426,'Explicar que la civilización europea se conforma a partir de la fragmentación de la unidad imperial de occidente y la confluencia de las tradiciones grecorromana, judeocristiana y germana, e identificar a la Iglesia Católica como el elemento que articuló esta síntesis y que legitimó el poder político. ','HI07  OA 09',1,7,3),(427,'Caracterizar algunos rasgos distintivos de la sociedad medieval, como la visión cristiana del mundo, el orden estamental, las relaciones de fidelidad, los roles de género, la vida rural y el declive de la vida urbana.','HI07  OA 10',1,7,3),(428,'Analizar ejemplos de relaciones de influencia, convivencia y conflicto entre el mundo europeo, el bizantino y el islámico durante la Edad Media, considerando la división del cristianismo y las relaciones de frontera entre la cristiandad y el islam en la península ibérica, entre otros. ','HI07  OA 11',1,7,3),(429,'Analizar las transformaciones que se producen en Europa a partir del siglo XII, considerando el renacimiento de la vida urbana, los cambios demográficos, las innovaciones tecnológicas, el desarrollo del comercio y el surgimiento de las universidades. ','HI07  OA 12',1,7,3),(430,' Identificar las principales características de las civilizaciones maya y azteca, considerando las tecnologías utilizadas para transformar el territorio que habitaban (urbanización, canales, acueductos y calzadas, formas de cultivo, entre otros) y el desarrollo de una red comercial que vinculaba al área mesoamericana. ','HI07  OA 13',1,7,3),(431,'Caracterizar el Imperio Inca, y analizar los factores que posibilitaron la dominación y unidad del Imperio (por ejemplo, red de caminos y sistema de comunicaciones, sistemas de cultivo, organización social, administración, ejército, mita y yanaconaje, sometimiento de pueblos y lengua oficial, entre otros).','HI07  OA 14',1,7,3),(432,'Describir las principales características culturales de las civilizaciones maya, azteca e inca (por ejemplo, arte, lengua, tradiciones, relaciones de género, sistemas de medición del tiempo, ritos funerarios y creencias religiosas), e identificar aquellos elementos que persisten hasta el presente. ','HI07  OA 15',1,7,3),(433,'Reconocer en expresiones culturales latinoamericanas del presente la confluencia del legado de múltiples civilizaciones como la maya, azteca, inca, griega, romana y europea. ','HI07  OA 16',1,7,3),(434,'Identificar los principios, mecanismos e instituciones que permitieron que en Atenas y en Roma se limitara el ejercicio del poder y se respetaran los derechos ciudadanos (por ejemplo, a través del equilibrio de poderes, del principio de elegibilidad, de la temporalidad de los cargos, de la ley y una cultura de la legalidad, de las magistraturas y del Senado romano, entre otros), reconociendo elementos de continuidad y de cambio con la actualidad.','HI07  OA 17',1,7,3),(435,'Comparar los conceptos de ciudadanía, democracia, derecho, república, municipio y gremio del mundo clásico y medieval, con la sociedad contemporánea. ','HI07  OA 18',1,7,3),(436,'Reconocer el valor de la diversidad como una forma de enriquecer culturalmente a las sociedades, identificando, a modo de ejemplo, los aportes que las distintas culturas existentes en el mundo antiguo y medieval (árabes, judeocristianos, germanos, eslavos, etc.) hicieron a las sociedades europeas, considerando el lenguaje, la religión y las ciencias, entre otros. ','HI07  OA 19',1,7,3),(437,'Reconocer distintas formas de convivencia y conflicto entre culturas en las civilizaciones estudiadas, y debatir sobre la importancia que tienen el respeto, la tolerancia y las estrategias de resolución pacífica de conflictos, entre otros, para la convivencia entre distintos pueblos y culturas.','HI07  OA 20',1,7,3),(438,'Reconocer procesos de adaptación y transformación que se derivan de la relación entre el ser humano y el medio, e identificar factores que inciden en el asentamiento de las sociedades humanas (por ejemplo, disponibilidad de recursos, cercanía a zonas fértiles, fragilidad del medio ante la acción humana, o la vulnerabilidad de la población ante las amenazas del entorno). ','HI07  OA 21',1,7,3),(439,'Reconocer y explicar formas en que la acción humana genera impactos en el medio y formas en las que el medio afecta a la población, y evaluar distintas medidas para propiciar efectos positivos y mitigar efectos negativos sobre ambos. ','HI07  OA 22',1,7,3),(440,'Investigar sobre problemáticas medioambientales relacionadas con fenómenos como el calentamiento global, los recursos energéticos, la sobrepoblación, entre otros, y analizar y evaluar su impacto a escala local.','HI07  OA 23',1,7,3),(441,'Analizar, apoyándose en diversas fuentes, la centralidad del ser humano y su capacidad de transformar el mundo en las expresiones culturales del Humanismo y del Renacimiento.','HI08  OA 01',1,8,3),(442,'Comparar la sociedad medieval y moderna, considerando los cambios que implicó la ruptura de la unidad religiosa de Europa, el surgimiento del Estado centralizado, el impacto de la imprenta en la difusión del conocimiento y de las ideas, la revolución científica y el nacimiento de la ciencia moderna, entre otros.','HI08  OA 02',1,8,3),(443,'Caracterizar el Estado moderno considerando sus principales rasgos, como la concentración del poder en la figura del rey, el desarrollo de la burocracia y de un sistema fiscal centralizado, la expansión del territorio, la creación de ejércitos profesionales y el monopolio del comercio internacional, y contrastar con la fragmentación del poder que caracterizó a la Edad Media. ','HI08  OA 03',1,8,3),(444,'Caracterizar la economía mercantilista del siglo XVI, considerando fenómenos económicos como la acumulación y circulación de metales preciosos, la ampliación de rutas comerciales, la expansión mundial de la economía europea, la revolución de los precios y el aumento de la competencia, entre otros.','HI08  OA 04',1,8,3),(445,'Argumentar por qué la llegada de los europeos a América implicó un enfrentamiento entre culturas, considerando aspectos como la profundidad de las diferencias culturales, la magnitud del escenario natural americano, y la desarticulación de la cosmovisión de las sociedades indígenas.','HI08  OA 05',1,8,3),(446,'Analizar los factores que explican la rapidez de la conquista y la caída de los grandes imperios americanos, considerando aspectos como la organización política, las diferencias en la forma de hacer la guerra, los intereses de los conquistadores y la catástrofe demográfica. ','HI08  OA 06',1,8,3),(447,' Analizar y evaluar el impacto de la conquista de América en la cultura europea, considerando la ampliación del mundo conocido, el desafío de representar una nueva realidad y los debates morales relacionados con la condición humana de los indígenas. ','HI08  OA 07',1,8,3),(448,' Analizar el rol de la ciudad en la administración del territorio del Imperio español, considerando las instituciones que concentraba, la relación con la metrópoli, el monopolio del comercio y la consolidación del poder local de las elites criollas.','HI08  OA 08',1,8,3),(449,' Caracterizar el barroco a través de distintas expresiones culturales de la sociedad colonial, como el arte, la arquitectura, la música, el teatro y las ceremonias, entre otros.','HI08  OA 09',1,8,3),(450,'Explicar la importancia de los mercados americanos en el comercio atlántico de los siglos XVII y XVIII, considerando el monopolio comercial, la exportación de materias primas, las distintas regiones productivas, el tráfico y empleo masivo de mano de obra esclava y el desarrollo de rutas comerciales.','HI08  OA 10',1,8,3),(451,'Analizar el proceso de formación de la sociedad colonial americana considerando elementos como la evangelización, la esclavitud y otras formas de trabajo no remunerado (por ejemplo, encomienda y mita), los roles de género, la transculturación, el mestizaje, la sociedad de castas, entre otros. ','HI08  OA 11',1,8,3),(452,'Analizar y evaluar las formas de convivencia y los tipos de conflicto que surgen entre españoles, mestizos y mapuches como resultado del fracaso de la conquista de Arauco, y relacionar con el consiguiente desarrollo de una sociedad de frontera durante la Colonia en Chile. ','HI08  OA 12',1,8,3),(453,'Analizar el rol de la hacienda en la conformación de los principales rasgos del Chile colonial, considerando el carácter rural de la economía, el desarrollo de un sistema de inquilinaje, la configuración de una elite terrateniente y de una sociedad con rasgos estamentales, y reconocer la proyección de estos elementos en los siglos XIX y XX.','HI08  OA 13',1,8,3),(454,'Caracterizar la Ilustración como corriente de pensamiento basada en la razón, considerando sus principales ideas tales como el ordenamiento constitucional, la separación y el equilibrio de poderes del Estado, los principios de libertad, igualdad y soberanía popular y la secularización, y fundamentar su rol en la crítica al absolutismo y en la promoción del ideario republicano. ','HI08  OA 14',1,8,3),(455,'Analizar cómo las ideas ilustradas se manifestaron en los procesos revolucionarios de fines del siglo XVIII y comienzos del siglo XIX, considerando la independencia de Estados Unidos, la Revolución Francesa y las independencias de las colonias españolas en Latinoamérica. ','HI08  OA 15',1,8,3),(456,'Explicar la independencia de las colonias hispanoamericanas como un proceso continental, marcado por la crisis del sistema colonial, la apropiación de las ideas ilustradas y la opción por el modelo republicano, y analizar en este marco el proceso de Independencia de Chile. ','HI08  OA 16',1,8,3),(457,'Contrastar las distintas posturas que surgieron en el debate sobre la legitimidad de la conquista durante el siglo XVI, y fundamentar la relevancia de este debate para la concepción de los derechos humanos en la actualidad.','HI08  OA 17',1,8,3),(458,'Explicar el concepto de derechos del hombre y del ciudadano difundido en el marco de la Ilustración y la Revolución francesa, y reconocer su vigencia actual en los derechos humanos.','HI08  OA 18',1,8,3),(459,'Evaluar las principales transformaciones y desafíos que generó la independencia de Chile, como la conformación de un orden republicano, la constitución de una ciudadanía inspirada en la soberanía popular y la formación de un Estado nacional, y fundamentar la relevancia de estas transformaciones para el Chile de la actualidad.','HI08  OA 19',1,8,3),(460,'Explicar los criterios que definen a una región, considerando factores físicos y humanos que la constituyen (por ejemplo, vegetación, suelo, clima, lengua común, religión, historia, entre otros), y dar ejemplos de distintos tipos de regiones en Chile y en América (culturales, geográficas, económicas, político-administrativas, etc.). ','HI08  OA 20',1,8,3),(461,' Analizar y evaluar problemas asociados a la región en Chile –como los grados de conexión y de aislamiento (considerando redes de transporte y comunicaciones, acceso a bienes, servicios e información, entre otros), índices demográficos y migración– y su impac