nes y los nuevos focos industriales. > Los cambios en el uso del suelo urbano.','HI2M  OA 06',1,11,3),(489,'Analizar el impacto de procesos históricos mundiales y latinoamericanos en Chile en las décadas de 1960 y 1970, considerando: > América Latina como zona de influencia norteamericana durante la Guerra Fría. > El impacto de la Revolución Cubana y la atracción por la vía armada en las izquierdas del continente. > La política norteamericana hacia América Latina (Alianza para el Progreso y Doctrina de Seguridad Nacional).','HI2M  OA 07',1,11,3),(490,'Caracterizar el Chile de la década de 1960, considerando la masificación de la participación política popular y la creciente demanda de cambio social.','HI2M  OA 08',1,11,3),(491,'Analizar testimonios y expresiones de la literatura y de las artes del periodo para identificar las transformaciones sociales y culturales en Chile durante las décadas de 1960 y 1970.','HI2M  OA 09',1,11,3),(492,'Evaluar los proyectos de cambios estructurales impulsados por la Democracia Cristiana y por la Unidad Popular, apoyándose en diversas fuentes de información y contrastando distintas visiones historiográficas. ','HI2M  OA 10',1,11,3),(493,'Comprender el proceso de reforma agraria en Chile, sus etapas y sus consecuencias en los ámbitos político, económico, social, y en el espacio geográfico. ','HI2M  OA 11',1,11,3),(494,'Analizar y comparar críticamente diversas visiones políticas e interpretaciones historiográficas sobre la crisis que desemboca en el quiebre democrático de 1973.','HI2M  OA 12',1,11,3),(495,'Caracterizar los principales rasgos del golpe de Estado y de la dictadura militar en Chile, incluyendo: > La violación sistemática de los Derechos Humanos, la violencia política y la supresión del Estado de derecho.','HI2M  OA 13',1,11,3),(496,'Valorar la lucha por la defensa de los Derechos Humanos y la recuperación de la democracia que desarrollaron distintos actores en la década de 1980, como organismos de defensa de Derechos Hu