),(504,'Analizar el origen histórico de la Constitución Política, sus desafíos pendientes y demandas de reformulación, así como las formas en que esta organiza el régimen democrático, estableciendo las bases de la institucionalidad, el carácter y la finalidad del Estado, y la regulación de los derechos y deberes políticos de los sujetos dentro de la nación.','HI 2M  OA 02',1,12,3),(505,'Evaluar crítica y propositivamente el rol de la Constitución Política en la organización del régimen democrático en Chile y en el respeto, garantía y promoción de los Derechos Humanos.','HI 2M  OA 03',1,12,3),(506,'Comprender y analizar el funcionamiento del sistema judicial en Chile, considerando los principales rasgos del sistema procesal penal y civil, así como las responsabilidades penales y civiles, mediante casos reales y vigentes.','HI 2M  OA 04',1,12,3),(507,'Caracterizar y evaluar los mecanismos de acceso a la justicia en Chile y valorar su importancia para el resguardo de los derechos de las personas y la convivencia ciudadana','HI 2M  OA 05',1,12,3),(508,'Caracterizar el sistema de representación política en Chile y sus desafíos pendientes, además de comprender su importancia para el funcionamiento de la democracia. ','HI 2M  OA 06',1,12,3),(509,'Reconocer distintas formas de participación de la comunidad (a nivel nacional, regional y comunal, en organizaciones no gubernamentales y con distintos fines) y valorar su importancia para el funcionamiento y mejoramiento del sistema político y la profundización de la democracia.','HI 2M  OA 07',1,12,3),(510,'Reflexionar críticamente sobre la importancia de las responsabilidades ciudadanas en la promoción del bienestar común.','HI 2M  OA 08',1,12,3),(511,'Evaluar los principales desafíos que enfrenta la organización democrática en el Chile actual y las distintas propuestas para abordarlos.','HI 2M  OA 09',1,12,3),(512,'Reflexionar críticamente sobre problemas y desafíos que enfrenta la sociedad chilena en la actualidad y levantar 