udas; demostrando interés ante lo escuchado; mostrando empatía frente a situaciones expresadas por otros; respetando turnos.','LE03 OA 26',1,3,1),(83,'Interactuar de acuerdo con las convenciones sociales en diferentes situaciones: presentarse a sí mismo y a otros, saludar, preguntar; expresar opiniones, sentimientos e ideas; situaciones que requieren el uso de fórmulas de cortesía como por favor, gracias, perdón, permiso.','LE03 OA 27',1,3,1),(84,'Expresarse de manera coherente y articulada sobre temas de su interés: organizando las ideas en introducción y desarrollo; incorporando descripciones y ejemplos que ilustren las ideas; utilizando un vocabulario variado; reemplazando los pronombres por construcciones sintácticas que expliciten o describan al referente; usando gestos y posturas acordes a la situación; usando material de apoyo (power point, papelógrafo, objetos, etc.) si es pertinente.','LE03 OA 28',1,3,1),(85,'Incorporar de manera pertinente en sus intervenciones orales el vocabulario nuevo extraído de textos escuchados o leídos.','LE03 OA 29',1,3,1),(86,'Caracterizar distintos personajes para desarrollar su lenguaje y autoestima, y aprender a trabajar en equipo.','LE03 OA 30',1,3,1),(87,'Recitar poemas con entonación y expresión para fortalecer la confianza en sí mismos, aumentar el vocabulario y desarrollar su capacidad expresiva.','LE03 OA 31',1,3,1),(88,'Leer en voz alta de manera fluida variados textos apropiados a su edad: pronunciando las palabras con precisión, respetando los signos de puntuación, leyendo con entonación adecuada, leyendo con velocidad adecuada para el nivel.','LE04 OA 01',1,4,1),(89,'Comprender textos aplicando estrategias de comprensión lectora; por ejemplo: relacionar la información del texto con sus experiencias y conocimientos; releer lo que no fue comprendido; visualizar lo que describe el texto; recapitular; formular preguntas sobre lo leído y responderlas; subrayar información relevante en un texto.','LE04 OA 02',1,4,1),(90,'L