ncias según un formato previamente acordado. ','LE08 OA 14',1,8,1),(218,' Escribir, con el propósito de persuadir, textos breves de diversos géneros (por ejemplo, cartas al director, editoriales, críticas literarias, etc.), caracterizados por: - La presentación de una afirmación referida a temas contingentes o literarios. - La presencia de evidencias e información pertinente. - La mantención de la coherencia temática.','LE08 OA 15',1,8,1),(219,'Planificar, escribir, revisar, reescribir y editar sus textos en función del contexto, el destinatario y el propósito: - Recopilando información e ideas y organizándolas antes de escribir. - Adecuando el registro, específicamente, el vocabulario (uso de términos técnicos, frases hechas, palabras propias de las redes sociales, términos y expresiones propios del lenguaje hablado), el uso de la persona gramatical, y la estructura del texto al género discursivo, contexto y destinatario. - Incorporando información pertinente. - Asegurando la coherencia y la cohesión del texto. - Cuidando la organización a nivel oracional y textual. - Usando conectores adecuados para unir las secciones que componen el texto y relacionando las ideas dentro de cada párrafo. - Usando un vocabulario variado y preciso. - Reconociendo y corrigiendo usos inadecuados, especialmente de pronombres personales y reflejos, conjugaciones verbales, participios irregulares, y concordancia sujeto–verbo, artículo–sustantivo y sustantivo–adjetivo. - Corrigiendo la ortografía y mejorando la presentación. - Usando eficazmente las herramientas del procesador de textos.','LE08 OA 16',1,8,1),(220,' Usar adecuadamente oraciones complejas: - Manteniendo un referente claro. - Conservando la coherencia temporal. - Ubicando el sujeto, para determinar de qué o quién se habla.','LE08 OA 17',1,8,1),(221,'Construir textos con referencias claras: - Usando recursos de correferencia como deícticos –en particular, pronombres personales tónicos y átonos– y nominalización, sustitución p