 de obras literarias, vinculándolas con otras manifestaciones artísticas, para desarrollar el pensamiento analítico, la sensibilidad social y la reflexión sobre el entorno cultural y social actual. ','LE2M OA 05',1,10,1),(248,'Leer comprensivamente, con distintos propósitos, textos en soportes impresos y electrónicos, con estructuras variadas, integrando variados elementos complejos, que aborden temas de diversos ámbitos. ','LE2M OA 06',1,10,1),(249,'Leer comprensivamente interpretando el sentido global del texto según las posibles perspectivas, evaluando lo leído. ','LE2M OA 07',1,10,1),(250,'Interpretar en los mensajes de los medios de comunicación, los mundos presentados, identificando elementos que los constituyen y valorando las posibles interpretaciones que de ellos ofrecen.','LE2M OA 08',1,10,1),(251,'Producir, en forma manuscrita y digital, textos de intención literaria y no literarios, para expresarse, narrar, describir, exponer o argumentar, organizando varias ideas o informaciones sobre un tema central, apoyadas por ideas complementarias, y marcando con una variedad de recursos las conexiones entre ellas, según contenido, propósito y audiencia. ','LE2M OA 09',1,10,1),(252,'Utilizar adecuadamente un léxico variado, incorporando algunos usos y matices menos frecuentes de palabras, expresiones y terminología de acuerdo con contenido, propósito y audiencia. ','LE2M OA 10',1,10,1),(253,'scribir textos utilizando flexiblemente diversos tipos de frases y oraciones de acuerdo con la estructura del texto. ','LE2M OA 11',1,10,1),(254,'Utilizar selectivamente diferentes estrategias de escritura, evaluándolas y modificándolas con el fin de mejorar la calidad de los textos, tomando decisiones sobre su presentación.','LE2M OA 12',1,10,1),(255,'Valorar la escritura como una actividad creativa y reflexiva de expresión personal, que permite organizar las ideas, presentar información, interactuar con diversas realidades y como una oportunidad para elaborar conscientemente 