pios, y alcanzando conclusiones luego de la confrontación dialógica.','LE3M OA 05',1,11,1),(261,'Escribir textos expositivosargumentativos, utilizando recursos gramaticales y discursivos, entre otros, los siguientes: > Conectores intraoracionales y relacionantes supraoracionales. > Correferencias léxicas y pronominales. > Verbos actitudinales (saber, creer, pensar, etcétera. > Modalizadores discursivos.','LE3M OA 06',1,11,1),(262,'Planificar y ejecutar una exposición oral, considerando: > Audiencia y contexto. > Interés y pertinencia del tema. > Estructura básica del discurso. > Recursos lingüísticos de carácter cognitivo y expresivo. > Duración de la intervención.','LE3M OA 07',1,11,1),(263,'Reconocer, describir y valorar los recursos de organización temporal como medios para relevar acontecimientos, personajes y temas, en una obra narrativa.','LE3M OA 08',1,11,1),(264,'Reconocer en el ensayo un género específico, diferente del narrativo, en el que los recursos literarios se ponen al servicio del desarrollo libre de ideas y la argumentación. ','LE3M OA 09',1,11,1),(265,'Analizar e interpretar ensayos modernos (siglos XVI a XX) que aborden temas relevantes de la vida personal y social, determinando, entre otros aspectos, los siguientes: > Los temas y su relevancia (pasada y actual). > Las tesis, argumentos y conclusiones. > La forma en que se enlazan temas, tesis, argumentos y conclusiones.','LE3M OA 10',1,11,1),(266,'Con respecto a personajes de obras narrativas, analizar críticamente a partir de: > La estructura psicológica que los caracteriza. > La relación específica entre dos o más personajes. > La forma en que la situación que viven determina sus pensamientos y sus reacciones. > Su evolución a lo largo de la obra.','LE3M OA 11',1,11,1),(267,'Analizar e interpretar obras artísticas y culturales de diversos soportes (afiche, cómic, cortometraje, largometraje, spots publicitarios, fotografía, escultura, pintura, danza, etcétera), profundizando en uno o más de los siguientes aspectos (entre otros): > Los temas a que se refieren. > Su propósito comunicativo. > Las razones por las que son de interés y relevancia para su público. > Su relación con el contexto históricocultural en que se producen.','LE3M OA 12',1,11,1),(268,'Describir, analizar y evaluar personajes de obras dramáticas, considerando, entre otros aspectos, su estructura psicológica, sus relaciones con otros personajes, su situación vital y su evolución.','LE3M OA 13',1,11,1),(269,'Analizar e interpretar el conflicto dramático en términos de los papeles de cada personaje, la integración dialógica de ideas y los valores comunicados.','LE3M OA 14',1,11,1),(270,'Identificar y describir los procedimientos discursivos aplicados por un emisor para exponer y desarrollar sus argumentos. Considerar, entre otros aspectos, la información utilizada, la progresión temática, la situación comunicativa y las presuposiciones que hace respecto del destinatario (creencias, conocimientos y valores).','LE3M OA 15',1,11,1),(271,'Reflexionar acerca de las relaciones entre argumentación y diálogo, en particular, respecto de la argumentación como un diálogo implícito y la importancia de los mecanismos de empatía y retroalimentación.','LE3M OA 16',1,11,1),(272,'Realizar representaciones o lecturas dramatizadas en las que se deben: > Manejar los recursos verbales y paraverbales. > Usar coherentemente la comunicación proxémica y kinésica. > Adecuar la enunciación y la actuación a los rasgos y propósitos de los personajes. > Lograr en la audiencia atención, sorpresa, asombro, risa, emoción, empatía, etcétera. ','LE3M OA 17',1,11,1),(273,'Aplicar intencionalmente los elementos que influyen y configuran los textos orales, mediante acciones como: > Definir previamente propósitos comunicativos y pragmáticos. > Adecuar el registro a la situación de enunciación y el tema. > Emplear recursos verbales y paraverbales pertinentes. ','LE3M OA 18',1,11,1),(274,'Aplicar de modo selectivo, variado y preciso, palabras y expresiones de acuerdo con el propósito, el tema y los destinatarios, considerando, cuando sea pertinente, el empleo consciente de: > Un vocabulario técnico de campos disciplinarios. > Préstamos de lenguas indígenas, con especial atención a las habladas en Chile. > Variantes léxicas dialectales. > Recursos poéticos, tales como metáforas, metonimias, comparaciones, hipérboles, entre otros.','LE3M OA 19',1,11,1),(275,'Comprender, analizar e interpretar obras cinematográficas que supongan un aporte relevante a la cultura. ','LE3M OA 20',1,11,1),(276,'Analizar e interpretar, comparando y contrastando, dos obras literarias de cualquier época y del mismo o de diferente género, respecto de, por ejemplo, sus temas, personajes, ambientes, registro, uso de figuras literarias y formas de representar la realidad.','LE3M OA 21',1,11,1),(277,'Analizar e interpretar comparativamente obras literarias con otras producciones culturales y artísticas, considerando, por ejemplo, los temas, la visión de mundo y las intertextualidades. ','LE3M OA 22',1,11,1),(278,'Conocer, comprender y comparar diferentes posturas ideológicas o estéticas en obras literarias y/o cinematográficas específicas.','LE3M OA 23',1,11,1),(279,'Comprender y evaluar argumentaciones orales en diferentes situaciones comunicativas (discursos, diálogos, intervenciones en discusiones, etc.), atendiendo a la estructura de argumentación, los recursos comunicativos empleados (lingüísticos y no lingüísticos) y la calidad de los argumentos.','LE3M OA 24',1,11,1),(280,'Escribir textos multimediales que se caractericen por: > Informar sobre un tema de actualidad previamente investigado. > Emplear adecuadamente programas informáticos (procesador de textos, planilla de cálculo, elaborador de gráficos, edición de imágenes visuales). > Integrar, al menos, información visual y verbal. > Tener una estructura no lineal coherente y fácil de seguir.','LE3M OA 25',1,11,1),(281,'Analizar e interpretar textos literarios de carácter reflexivoargumentativo (ensayos, crónicas de opinión, columnas de opinión, etcétera) de autores chilenos y latinoamericanos de los siglos XIX y XX. ','LE4M OA 01',1,12,1),(282,'Identificar, definir y comparar las configuraciones (estructuras) típicas o ideales de los textos expositivosargumentativos, en particular respecto de las secuencias discursivas que incorporan: narrativa, descriptiva, explicativa, dialógica y argumentativa. ','LE4M OA 02',1,12,1),(283,'Analizar, interpretar y comparar novelas de anticipación social distópica. ','LE4M OA 03',1,12,1),(284,'Planificar y ejecutar debates sobre temas polémicos de interés público, considerando: > Una adecuada delimitación del tema en términos de que sea de interés público. > Una investigación previa que permita recolectar información y puntos de vista pertinentes. > Una o más tesis específicas a exponer y defender. > Recursos lingüísticos de carácter cognitivo y expresivo, por ejemplo: metáforas, metonimias, analogías y ejemplificaciones. ','LE4M OA 04',1,12,1),(285,'Comprender y evaluar los argumentos usados por otros durante una presentación oral, un debate, un foro, una mesa redonda o en discusiones usuales de aula.','LE4M OA 05',1,12,1),(286,'Escuchar y analizar un discurso argumentativo dialéctico pronunciado en una situación pública, considerando: > La relevancia personal y social de los temas. > Las tesis y los argumentos que lo sostienen. > Recursos lingüísticos de carácter cognitivo y afectivo. > Recursos kinésicos y proxémicos. > Eventuales recursos y estrategias de retroalimentación y empatía.','LE4M OA 06',1,12,1),(287,'Analizar, interpretar y comparar relatos de perspectivas múltiples (epistolares, collages, entre otros).','LE4M OA 07',1,12,1),(288,'Analizar, interpretar y comparar relatos de narrador omnisciente con focalización interna en uno o más personajes, o bien, de focalización cero.','LE4M OA 08',1,12,1),(289,'Analizar e interpretar obras líricas del siglo XX que aborden el tema del amor y el deseo. ','LE4M OA 09',1,12,1),(290,'Participar activamente en debates, foros, paneles y discusiones usuales de aula, atendiendo a: > La pertinencia de lo que se dice. > El valor de verdad del propio discurso. > Su extensión.','LE4M OA 10',1,12,1),(291,'Escribir textos multimediales que: > Informen sobre un tema de actualidad previamente investigado. > Supongan el empleo adecuado de programas informáticos (procesador de textos, planilla de cálculo, elaborador de gráficos, edición de imágenes visuales). > Integren, al menos, información visual y verbal. > Tengan una estructura no lineal coherente y fácil de seguir. ','LE4M OA 11',1,12,1),(292,'Analizar e interpretar obras literarias que tematicen la vida social y política, problematizando su relación con el contexto histórico de producción, o bien con el de recepción.','LE4M OA 12',1,12,1),(293,'Analizar e interpretar una entrevista de periodismo escrito con rasgos de reportaje de opinión. ','LE4M OA 13',1,12,1),(294,'Analizar, interpretar y evaluar programas radiales y televisivos que se centren en el diálogo y la interacción, tales como programas de charla (talk shows), entrevistas, programas de discusión política y programas de telerrealidad (reality shows). ','LE4M OA 14',1,12,1),(295,'Comprender, analizar e interpretar textos argumentativos de carácter público.','LE4M OA 15',1,12,1),(296,'Comprender, analizar e interpretar obras cinematográficas que supongan un aporte relevante a la cultura. ','LE4M OA 16',1,12,1),(297,'Producir un discurso en situación de comunicación pública fuera del aula, teniendo en cuenta: > La relevancia personal y social de los temas. > Las tesis y los argumentos que las sostienen. > Recursos lingüísticos de carácter cognitivo y afectivo. > Recursos kinésicos y proxémicos. > Recursos y estrategias de retroalimentación y empatía. ','LE4M OA 17',1,12,1),(298,'Analizar, interpretar y comparar obras dramáticas modernas y contemporáneas que aborden el tema de la mujer y su situación dentro de la sociedad. ','LE4M OA 18',1,12,1),(299,'Comprender, analizar e interpretar obras dramáticas modernas y contemporáneas (teatro de los siglos XIX y XX, de postguerra, surrealista, épico, teatro del absurdo, etcétera)','LE4M OA 19',1,12,1),(300,'Analizar e interpretar, comparando y contrastando, dos obras literarias de cualquier época y del mismo o de diferente género, respecto de, por ejemplo, sus temas, personajes, ambientes, registro, uso de figuras literarias y formas de representar la realidad','LE4M OA 20',1,12,1),(301,'Analizar e interpretar comparativamente obras literarias con otras producciones culturales y artísticas, considerando, por ejemplo, los temas, la visión de mundo y las intertextualidades. ','LE4M OA 21',1,12,1),(302,'Comprender y comparar diferentes posturas ideológicas o estéticas en obras literarias y/o cinematográficas específicas.','LE4M OA 22',1,12,1),(303,'Planificar y ejecutar montajes teatrales parciales o totales en forma grupal.','LE4M OA 23',1,12,1),(304,'Nombrar y secuenciar días de la semana y meses del año, utilizando calendarios, e identificar el año en curso.','HI01  OA 01',1,1,3),(305,'Secuenciar acontecimientos y actividades de la vida cotidiana, personal y familiar, utilizando categorías relativas de ubicación temporal, como antes, después; ayer, hoy, mañana; día, noche; este año, el año pasado, el año próximo.','HI01  OA 02',1,1,3),(306,'Registrar y comunicar información sobre elementos que forman parte de su identidad personal (nombre, fecha de nacimiento, lugar de procedencia, ascendencias, gustos, intereses, amigos y otros) para reconocer sus características individuales.','HI01  OA 03',1,1,3),(307,'Obtener y comunicar aspectos de la historia de su familia y sus características, como costumbres, tradiciones, ritos, fiestas, recuerdos y roles que desempeñan los distintos miembros de su grupo familiar, mediante la formulación de preguntas a adultos de su entorno cercano.','HI01  OA 04',1,1,3),(308,'Reconocer los símbolos representativos de Chile (como la bandera, el escudo y el himno nacional), describir costumbres, actividades y la participación de hombres y mujeres respecto de conmemoraciones nacionales (como Fiestas Patrias, Día del Descubrimiento de dos mundos y Combate Naval de Iquique) y reconocer en ellos un elemento de unidad e identidad nacional.','HI01  OA 05',1,1,3),(309,'Conocer expresiones culturales locales y nacionales (como comidas, flores y animales típicos, música y juegos, entre otros), describir fiestas y tradiciones importantes de nivel local (como Fiesta de La Tirana, Fiesta de San Pedro, Fiesta de Cuasimodo, carreras a la chilena, el rodeo, la vendimia y la fundación del pueblo o de la ciudad, entre otras) y reconocer estas expresiones como elementos de unidad e identidad local y/o nacional.','HI01  OA 06',1,1,3),(310,'Conocer sobre la vida de hombres y mujeres que han contribuido a la sociedad chilena en diversos ámbitos; por ejemplo, los fundadores de las ciudades, los exploradores, las personas que han fundado o creado instituciones, las personas que se han destacado por su emprendimiento y su solidaridad, los deportistas, los científicos, los artistas y los grandes poetas, entre otros.','HI01  OA 07',1,1,3),(311,'Reconocer que los mapas y planos son formas de representar lugares.','HI01  OA 08',1,1,3),(312,'Identificar a Chile en mapas, incluyendo la cordillera de los Andes, el océano Pacífico, su región, su capital y su localidad.','HI01  OA 09',1,1,3),(313,'Observar y describir paisajes de su entorno local, utilizando vocabulario geográfico adecuado (país, ciudad, camino, pueblo, construcciones, cordillera, mar, vegetación y desierto) y categorías de ubicación relativa (derecha, izquierda, delante, detrás, entre otros).','HI01  OA 10',1,1,3),(314,'Identificar trabajos y productos de su familia y su localidad y cómo estos aportan a su vida diaria, reconociendo la importancia de todos los trabajos, tanto remunerados como no remunerados.','HI01  OA 11',1,1,3),(315,'Conocer cómo viven otros niños en diferentes partes del mundo por medio de imágenes y relatos, ubicando en un globo terráqueo o mapamundi los países donde habitan, y comparando su idioma, vestimenta, comida, fiestas, costumbres y principales tareas con las de niños chilenos.','HI01  OA 12',1,1,3),(316,'Mostrar actitudes y realizar acciones concretas en su entorno cercano (familia, escuela y comunidad) que reflejen: el respeto al otro (ejemplos: escuchar atentamente al otro, tratar con cortesía a los demás, etc.), la empatía (ejemplos: ayudar a los demás cuando sea necesario, no discriminar a otros por su aspecto o costumbres, etc.), la responsabilidad (ejemplos: asumir encargos en su casa y su sala de clases, cuidar sus pertenencias y las de los demás, cuidar los espacios comunes, etc).','HI01  OA 13',1,1,3),(317,'Explicar y aplicar algunas normas para la buena convivencia y para la seguridad y el autocuidado en su familia, en la escuela y en la vía pública.','HI01  OA 14',1,1,3),(318,'Identificar la labor que cumplen, en beneficio de la comunidad, instituciones como la escuela, la municipalidad, el hospital o la posta, Carabineros de Chile, y las personas que trabajan en ellas.','HI01  OA 15',1,1,3),(319,'Describir los modos de vida de algunos pueblos originarios de Chile en el periodo precolombino, incluyendo ubicación geográfica, medio natural en que habitaban, vida nómada o sedentaria, roles de hombres y mujeres, herramientas y tecnología, principales actividades, vivienda, costumbres, idioma, creencias, alimentación y fiestas, entre otros.','HI02  OA 01',1,2,3),(320,'Comparar el modo de vida y expresiones culturales de algunos pueblos indígenas presentes en Chile actual (como mapuche, aimara o rapa nui) con respecto al periodo precolombino, identificando aspectos de su cultura que se han mantenido hasta el presente y aspectos que han cambiado.','HI02  OA 02',1,2,3),(321,'Distinguir los diversos aportes a la sociedad chilena proveniente de los pueblos originarios (palabras, alimentos, tradiciones, cultura, etc.) y de los españoles (idioma, religión, alimentos, cultura, etc.) y reconocer nuestra sociedad como mestiza.','HI02  OA 03',1,2,3),(322,'Reconocer y dar ejemplos de la influencia y aportes de inmigrantes de distintas naciones europeas, orientales, árabes y latinoamericanas a la diversidad de la sociedad chilena, a lo largo de su historia. ','HI02  OA 04',1,2,3),(323,'Reconocer diversas expresiones del patrimonio cultural del país y de su región, tales como manifestaciones artísticas, tradiciones folclóricas, leyendas y tradiciones orales, costumbres familiares, creencias, idioma, construcciones, comidas típicas, fiestas, monumentos y sitios históricos.','HI02  OA 05',1,2,3),(324,'Leer y dibujar planos simples de su entorno, utilizando puntos de referencia, categorías de posición relativa y simbología pictórica.','HI02  OA 06',1,2,3),(325,'Ubicar Chile, Santiago, la propia región y su capital en el globo terráqueo o en mapas, y describir la ubicación relativa de países limítrofes y de otros países de América del Sur, utilizando los puntos cardinales.','HI02  OA 07',1,2,3),(326,'Clasificar y caracterizar algunos paisajes de Chile según su ubicación en la zona norte, centro y sur del país, observando imágenes, utilizando diversas fuentes y un vocabulario geográfico adecuado (océano, río, cordillera de los Andes y de la Costa, desierto, valle, costa, volcán, archipiélago, isla, fiordo, lago, ciudad y pueblo, entre otros).','HI02  OA 08',1,2,3),(327,'Reconocer diversas expresiones del patrimonio natural de Chile y de su región, como paisajes, flora y fauna característica y parques nacionales, entre otros.','HI02  OA 09',1,2,3),(328,'Ubicar en mapas las zonas habitadas por algunos pueblos originarios de Chile, distinguiendo zonas norte, centro y sur.','HI02  OA 10',1,2,3),(329,'Relacionar las principales características geográficas (disponibilidad de agua, temperatura y vegetación) de las zonas habitadas por algunos pueblos originarios de Chile, con los recursos que utilizaron para satisfacer sus necesidades de alimentación, abrigo y vivienda.','HI02  OA 11',1,2,3),(330,'Mostrar actitudes y realizar acciones concretas en su entorno cercano (familia, escuela y comunidad) que reflejen: respeto al otro (interactuar con cortesía, cuidar espacios comunes, respetar propiedad de los demás); responsabilidad (ejemplos: cumplir con sus deberes escolares, asumir encargos en el hogar y dentro de la sala de clases, etc.); tolerancia (ejemplos: respetar opiniones diversas, no discriminar a otros por su aspecto o costumbres, etc.); empatía (ejemplos: integrar a los demás en sus juegos y actividades, ayudar a los otros, etc.).','HI02  OA 12',1,2,3),(331,'Mantener una conducta honesta en la vida cotidiana, en los juegos y en el trabajo escolar, hablando con la verdad, respetando las reglas de los juegos sin hacer trampa, y reconociendo sus errores y sus acciones, entre otros.','HI02  OA 13',1,2,3),(332,'Conocer, proponer, aplicar y explicar la importancia de algunas normas necesarias para: cuidarse, cuidar a otros y evitar situaciones de riesgo (como seguridad vial, vías de evacuación, adaptaciones para discapacitados, zonas de silencio); organizar un ambiente propicio al aprendizaje y acogedor para todos (por ejemplo, respetar los turnos, cuidar el espacio y las pertenencias comunes y de sus pares, etc.); cuidar el patrimonio y el medioambiente.','HI02  OA 14',1,2,3),(333,'Identificar la labor que cumplen en beneficio de la comunidad servicios como los medios de transporte y de comunicación y el mercado, y algunas instituciones encargadas de proteger nuestro patrimonio cultural y natural.','HI02  OA 15',1,2,3),(334,'Practicar y proponer acciones para cuidar y respetar los espacios públicos dentro y fuera de la escuela (como baños, patios, salas de clase, plazas, parques, playas y calles, entre otros), reconociendo que pertenecen y benefician a todos y que, por lo tanto, su cuidado es responsabilidad de todos los miembros de la comunidad.','HI02  OA 16',1,2,3),(335,'Reconocer aspectos de la vida cotidiana de la civilización griega de la Antigüedad e identificar algunos elementos de su legado a sociedades y culturas del presente; entre ellos, la organización democrática, el desarrollo de la historia, el teatro como forma de expresión, el arte y la escultura, la arquitectura, la mitología, la geometría y la filosofía, la creación del alfabeto y los juegos olímpicos.','HI03  OA 01',1,1,3),(336,'Reconocer aspectos de la vida cotidiana de la civilización romana de la Antigüedad e identificar algunos elementos de su legado a sociedades y culturas del presente; entre ellos, el idioma, el derecho y las leyes, el arte y las obras arquitectónicas.','HI03  OA 02',1,1,3),(337,'Explicar, con ejemplos concretos, cómo diferentes culturas y pueblos (como griegos y romanos de la Antigüedad) han enfrentado de distintas maneras el desafío de desarrollarse y satisfacer las necesidades comunes a todos los seres humanos.','HI03  OA 03',1,1,3),(338,'Comparar modos de vida de la Antigüedad con el propio, considerando costumbres, trabajos y oficios, creencias, vestimentas y características de las ciudades, entre otros.','HI03  OA 04',1,1,3),(339,'Investigar sobre algún tema de su interés con relación a las civilizaciones estudiadas (como los héroes, los dioses, las ciudades, las viviendas, la vestimenta, las herramientas tecnológicas y la esclavitud, entre otros) por medio de diferentes fuentes (libros, fuentes gráficas, TIC) y comunicar lo aprendido.','HI03  OA 05',1,3,3),(340,'Ubicar personas, lugares y elementos en una cuadrícula, utilizando líneas de referencia y puntos cardinales.','HI03  OA 06',1,3,3),(341,'Distinguir hemisferios, círculo del Ecuador, trópicos, polos, continentes y océanos del planeta en mapas y globos terráqueos.','HI03  OA 07',1,3,3),(342,'Identificar y ubicar en mapas las principales zonas climáticas del mundo y dar ejemplos de distintos paisajes que pueden encontrarse en estas zonas y de cómo las personas han elaborado diferentes estrategias para habitarlos.','HI03  OA 08',1,3,3),(343,'Caracterizar el entorno geográfico de las civilizaciones estudiadas, utilizando vocabulario geográfico adecuado (continente, valle, montaña, océano, río, archipiélago, mares, península, ciudad, construcciones y monumentos, entre otros).','HI03  OA 09',1,3,3),(344,'Reconocer algunos factores geográficos que influyeron en el desarrollo de las civilizaciones estudiadas (ubicación, relieve y clima, recursos naturales disponibles, importancia del mar Egeo y sus islas para Grecia e importancia del mar Mediterráneo para Roma, entre otros).','HI03  OA 10',1,3,3),(345,'Asumir sus deberes y responsabilidades como estudiante y en situaciones de la vida cotidiana, como cumplir con sus deberes escolares, colaborar en el orden y en la limpieza de los espacios que comparte con su familia, escuela y comunidad, cuidar sus pertenencias y las de los demás, preocuparse de su salud e higiene y ayudar en su casa.','HI03  OA 11',1,3,3),(346,'Mostrar actitudes y realizar acciones concretas en su entorno cercano (familia, escuela y comunidad) que reflejen valores y virtudes ciudadanas, como: la tolerancia y el respeto al otro (ejemplos: respetar las opiniones distintas distintas a las propias, mostrar disposición al diálogo, respetar expresiones de diversidad, como diferentes costumbres, creencias, origen étnico, nacionalidad, etc.); la empatía (ejemplos: demostrar cortesía con los demás, escuchar al otro, ayudar a quien lo necesite, etc).','HI03  OA 12',1,3,3),(347,'Mantener una conducta honesta en la vida cotidiana, en los juegos y en el trabajo escolar, hablando con la verdad, respetando las reglas de los juegos sin hacer trampa y reconociendo sus errores y sus acciones, entre otros.','HI03  OA 13',1,3,3),(348,'Reconocer que los niños tienen derechos que les permiten recibir un cuidado especial por parte de la sociedad con el fin de que puedan aprender, crecer y desarrollarse, y dar ejemplos de cómo la sociedad les garantiza estos derechos.','HI03  OA 14',1,3,3),(349,'Investigar y comunicar sus resultados sobre algunas instituciones públicas y privadas (como Junaeb, Sernac, SII, BancoEstado, instituciones de previsión y de salud, universidades, Hogar de Cristo y fundaciones, entre otras), identificando el servicio que prestan en la comunidad y los diferentes trabajos que realizan las personas que se desempeñan en ellas.','HI03  OA 15',1,3,3),(350,'Participar responsable y activamente en su hogar (encargos, celebraciones, cuidado de las cosas) y en la escuela (campañas solidarias, celebraciones, deportes y juegos), cumpliendo compromisos y responsabilidades adquiridos.','HI03  OA 16',1,3,3),(351,'Describir la civilización maya, considerando ubicación geográfica, organización política, actividades económicas, formas de cultivo y alimentos, organización de la sociedad, roles y oficios de hombres y mujeres, religión y ritos, desarrollo de la astronomía y la matemática, sistemas de escritura, guerras y sacrificios humanos, construcciones, costumbres y vida cotidiana, entre otros.','HI04  OA 01',1,4,3),(352,'Describir la civilización azteca, considerando ubicación geográfica, organización política y extensión, la ciudad de Tenochtitlán, formas de cultivo y alimentos, religión y ritos, avances tecnológicos, organización de la sociedad, roles y oficios de hombres y mujeres, construcciones, costumbres y vida cotidiana, entre otros.','HI04  OA 02',1,4,3),(353,'Describir la civilización inca, considerando ubicación geográfica, organización política, sistema de caminos y correos, religión y ritos, avances tecnológicos, organización de la sociedad, roles y oficios de hombres y mujeres, formas de cultivo y alimentos, construcciones, costumbres y vida cotidiana, entre otros.','HI04  OA 03',1,4,3),(354,'Analizar y comparar las principales características de las civilizaciones americanas (mayas, aztecas e incas).','HI04  OA 04',1,4,3),(355,'Investigar en diversas fuentes (imágenes, medios audiovisuales, TICs, gráficos, textos y otras) sobre algunos temas relacionados con el presente de los pueblos indígenas americanos; por ejemplo, el protagonismo que tienen hoy, la influencia de las civilizaciones maya, azteca e inca sobre la cultura y la sociedad de los países actuales, situados donde ellos se desarrollaron, y su influencia en las comidas y en la lengua que empleamos en la actualidad, entre otros.','HI04  OA 05',1,4,3),(356,'Investigar en diversas fuentes (imágenes, medios audiovisuales, TICs, gráficos, textos y otras) sobre algunos temas relacionados con el presente de los pueblos indígenas americanos; por ejemplo, el protagonismo que tienen hoy, la influencia de las civilizaciones maya, azteca e inca sobre la cultura y la sociedad de los países actuales, situados donde ellos se desarrollaron, y su influencia en las comidas y en la lengua que empleamos en la actualidad, entre otros.','HI04  OA 06',1,4,3),(357,'Ubicar lugares en un mapa, utilizando coordenadas geográficas como referencia (paralelos y meridianos).','HI04  OA 07',1,4,3),(358,'Distinguir recursos naturales renovables y no renovables, reconocer el carácter limitado de los recursos naturales y la necesidad de cuidarlos, e identificar recursos presentes en objetos y bienes cotidianos.','HI04  OA 08',1,4,3),(359,'Describir distintos paisajes del continente americano, considerando climas, ríos, población, idiomas, países y grandes ciudades, entre otros, y utilizando vocabulario geográfico adecuado.','HI04  OA 09',1,4,3),(360,'Reconocer y ubicar los principales recursos naturales de América, considerando su distribución geográfica, su uso, y la importancia de cuidarlos en el marco de un desarrollo sostenible.','HI04  OA 10',1,4,3),(361,'Comparar, mediante la observación en imágenes, mapas y otras fuentes, paisajes de su región con paisajes de América, distinguiendo distintas formas de adaptación y transformación de la población a su ambiente natural.','HI04  OA 11',1,4,3),(362,'Distinguir algunos actores de la organización política y democrática de Chile, como Presidente, ministros, senadores, diputados y alcaldes, considerando las instituciones en las que ejercen y cómo son nombrados o elegidos.','HI04  OA 12',1,4,3),(363,'Reconocer sus principales derechos en situaciones de la vida cotidiana, como el derecho a la educación, a contar con alimentación, vivienda, recreo y servicios médicos adecuados, a expresarse, a ser protegido contra el abandono y la crueldad, y a no trabajar antes de la edad apropiada; y dar ejemplos de cómo se pueden ejercer y proteger esos derechos.','HI04  OA 13',1,4,3),(364,'Mantener una conducta honesta en la vida cotidiana, en los juegos y en el trabajo escolar, hablando con la verdad, respetando las reglas de los juegos sin hacer trampa, evitando la copia y el plagio y reconociendo sus errores y sus acciones, entre otros.','HI04  OA 14',1,4,3),(365,'Demostrar respeto por todas las personas mediante acciones en su vida diaria, sin discriminar por condiciones físicas, sociales, económicas, étnicas o culturales.','HI04  OA 15',1,4,3),(366,'Participar en su comunidad, tomando parte en elecciones para una directiva del curso, asignando roles y funciones a cada cargo, y considerando la importancia de mantener una buena convivencia y una organización del curso que favorezca el trabajo escolar.','HI04  OA 16',1,4,3),(367,'Resolver conflictos, aplicando estrategias como determinar la causa del problema, proponer posibles soluciones, dialogar, buscar un punto de vista común y votar, entre otras, demostrando respeto y empatía por las partes involucradas para mejorar la convivencia en el curso y en la comunidad escolar.','HI04  OA 17',1,4,3),(368,'Diseñar y participar activamente en un proyecto grupal que solucione un problema de la comunidad escolar; por ejemplo, reciclaje de la basura, exceso de ruido, organización de turnos, leer o entretener a alumnos más pequeños, etc.','HI04  OA 18',1,4,3),(369,'Opinar y argumentar con fundamentos sobre temas de la asignatura u otros.','HI04  OA 19',1,4,3),(370,'Explicar los viajes de descubrimiento de Cristóbal Colón, de Hernando de Magallanes y de algún otro explorador, considerando sus objetivos, las rutas recorridas, los avances tecnológicos que facilitaron la navegación, las dificultades y los desafíos que enfrentaron las tripulaciones y el contexto europeo general en que se desarrollaron.','HI05  OA 01',1,5,3),(371,'Describir el proceso de conquista de América y de Chile, incluyendo a los principales actores (Corona española, Iglesia católica y hombres y mujeres protagonistas, entre otros), algunas expediciones y conflictos bélicos, y la fundación de ciudades como expresión de la voluntad de los españoles de quedarse y expandirse, y reconocer en este proceso el surgimiento de una nueva sociedad.','HI05  OA 02',1,5,3),(372,'Analizar el impacto y las consecuencias que tuvo el proceso de conquista para Europa y para América, considerando diversos ámbitos.','HI05  OA 03',1,5,3),(373,'Investigar sobre los efectos de la conquista sobre los pueblos indígenas americanos, utilizando fuentes dadas por el docente.','HI05  OA 04',1,5,3),(374,'Describir algunas dimensiones de la vida colonial en Chile, como organización de la sociedad y grupos sociales, oficios y actividades económicas, costumbres y vida cotidiana, arte y celebraciones.','HI05  OA 05',1,5,3),(375,'Explicar aspectos centrales de la Colonia, como la dependencia de las colonias americanas de la metrópoli, el rol de la Iglesia católica y el surgimiento de una sociedad mestiza.','HI05  OA 06',1,5,3),(376,'Explicar y dar ejemplos de las distintas formas en las que españoles y mapuches se relacionaron en el período colonial, considerando resistencia mapuche y guerra de Arauco, mestizaje, formas de trabajo (como encomienda y esclavitud), evangelización, vida fronteriza y sistema de parlamentos.','HI05  OA 07',1,5,3),(377,'Identificar, en su entorno o en fotografías, elementos del patrimonio colonial de Chile que siguen presentes hoy, como edificios, obras de arte y costumbres, entre otros.','HI05  OA 08',1,5,3),(378,'Caracterizar las grandes zonas de Chile y sus paisajes (Norte Grande, Norte Chico, Zona Central, Zona Sur y Zona Austral), considerando ubicación, clima (temperatura y precipitaciones), relieve, hidrografía, población y recursos naturales, entre otros.','HI05  OA 09',1,5,3),(379,'Reconocer y ubicar en mapas recursos naturales significativos de Chile, como cobre, hierro, recursos marítimos y forestales, entre otros; diferenciar recursos renovables y no renovables y explicar la importancia de cuidarlos en el marco de un desarrollo sostenible.','HI05  OA 10',1,5,3),(380,'Analizar y dar ejemplos de diversas maneras en las que el trabajo de las personas, sus ideas y proyectos potencian y dan valor a los recursos naturales (por ejemplo: tecnología de riego, elaboración de vinos, uso de madera en la construcción, nuevas formas de explotación sustentable).','HI05  OA 11',1,5,3),(381,'Investigar, describir y ubicarlos riesgos naturales que afectan a su localidad, como sismos, maremotos, inundaciones, derrumbes y volcanismo, e identificar formas en que la comunidad puede protegerse (construcciones antisísmicas, medidas de seguridad y evacuación en el hogar, en la escuela y en los distintos espacios públicos, entre otros).','HI05  OA 12',1,5,3),(382,'Reconocer que todas las personas son sujetos de derecho, que deben ser respetados por los pares, la comunidad y el Estado, y que esos derechos no dependen de características individuales, como etnia, sexo, lugar de nacimiento u otras.','HI05  OA 13',1,5,3),(383,'Reconocer que los derechos generan deberes y responsabilidades en las personas y en el Estado, lo que, por ejemplo, se manifiesta en que: las personas deben respetar los derechos de los demás; todas las personas deben respetar las leyes; el Estado debe asegurar que las personas puedan ejercer sus derechos (a la educación, a la protección de la salud, a la libertad de expresión, a la propiedad privada y a la igualdad ante la ley, entre otros); el Estado debe asegurar los derechos de las personas a participar en la vida pública, como el derecho a formar organizaciones de participación social (fundaciones, juntas de vecinos, etc.), a participar en partidos políticos y el derecho a sufragio, entre otros.','HI05  OA 14',1,5,3),(384,'Reconocer que hay logros y beneficios que dependen del esfuerzo, el mérito y el comportamiento de cada persona (como las calificaciones, los premios deportivos, los premios por compañerismo, el aprecio y el reconocimiento por parte de sus pares, liderazgo).','HI05  OA 15',1,5,3),(385,'Demostrar actitudes cívicas con acciones en su vida diaria, como: actuar con honestidad y responsabilidad (ejemplos: respetar los acuerdos establecidos, respetar la autoría de música y películas, evitar el plagio escolar, etc.); respetar a todas las personas (ejemplos: no discriminar por condiciones físicas, sociales, culturales o étnicas, escuchar respetuosamente opiniones distintas, respetar espacios y propiedad de los demás, etc.); contribuir a la buena convivencia (ejemplos: buscar soluciones pacíficas para resolver problemas, mostrar empatía con los demás, etc.); cuidar y valorar el patrimonio y el medioambiente (ejemplos: realizar campañas de información y cuidado de nuestro patrimonio, usar la energía de manera eficiente, etc.).','HI05  OA 16',1,5,3),(386,'Participaren su comunidad, tomando parte en elecciones para una directiva de curso, asignando roles y funciones a cada cargo, y demostrando que entienden las responsabilidades que lleva consigo el desempeño de un cargo y la importancia de elegir personas que se estimen idóneas, para mantener una buena convivencia y una organización del curso que permita el trabajo escolar.','HI05  OA 17',1,5,3),(387,'Diseñar y participar en un proyecto que solucione un problema de la comunidad escolar, considerando temas como voluntariado, gasto excesivo de agua y electricidad en la escuela, y cuidado del medioambiente, entre otros, y ateniéndose a un plan y a un presupuesto.','HI05  OA 18',1,5,3),(388,'Explicar formas en que un grupo de personas puede organizarse para resolver problemas, mejorar su calidad de vida y la de otros y lograr metas comunes; por ejemplo, fundaciones, voluntariado, empresas, agrupaciones y recolección de fondos para causas benéficas.','HI05  OA 19',1,5,3),(389,'Opinar y argumentar con fundamentos sobre temas de la asignatura u otros.','HI05  OA 20',1,5,3),(390,'Evaluar posibles soluciones frente a un problema o proyecto y justificar su elección.','HI05  OA 21',1,5,3),(391,'Informarse y opinar sobre temas relevantes y de su interés en el país y el mundo (política, medioambiente, deporte, arte y música, entre otros) por medio de periódicos y TlC.','HI05  OA 22',1,5,3),(392,'Explicar los múltiples antecedentes de la independencia de las colonias americanas y reconocer que la independencia de Chile se enmarca en un proceso continental.','HI06  OA 01',1,6,3),(393,'Explicar el desarrollo del proceso de independencia de Chile, considerando actores y bandos que se enfrentaron, hombres y mujeres destacados, avances y retrocesos de la causa patriota y algunos acontecimientos significativos, como la celebración del cabildo abierto de 1810 y la formación de la Primera Junta Nacional de Gobierno, la elección del primer Congreso Nacional, las batallas de Rancagua, Chacabuco y Maipú, y la Declaración de la Independencia, entre otros.','HI06  OA 02',1,6,3),(394,'Describir algunos hitos y procesos de la organización de la república, incluyendo las dificultades y los desafíos que implicó organizar en Chile una nueva forma de gobierno, el surgimiento de grupos con diferentes ideas políticas (conservadores y liberales), las características de la Constitución de 1833 y el impacto de las reformas realizadas por los liberales en la segunda mitad del siglo XIX.','HI06  OA 03',1,6,3),(395,'Investigar sobre algunos aspectos culturales del siglo XIX, como los avances en educación y la fundación de instituciones, el aporte de intelectuales y científicos nacionales (por ejemplo, Diego Barros Arana, Benjamín Vicuña Mackenna, José Victorino Lastarria) y extranjeros (por ejemplo, Andrés Bello, Claudio Gay, Charles Darwin y María Graham), las primeras mujeres en obtener títulos universitarios y el impacto en la sociedad de la llegada del ferrocarril y de otros avances tecnológicos, entre otros.','HI06  OA 04',1,6,3),(396,'Describir cómo se conformó el territorio de Chile durante el siglo XIX, considerando colonizaciones europeas, la incorporación de Isla de Pascua, la ocupación de la Araucanía, la Guerra del Pacífico y diversos conflictos bélicos, entre otros factores.','HI06  OA 05',1,6,3),(397,'Caracterizar los principales aspectos que definieron el período de riqueza aportada por la explotación del salitre, considerando la expansión económica y el inicio de la \"cuestión social\".','HI06  OA 06',1,6,3),(398,'Explicar y dar ejemplos de la progresiva democratización de la sociedad durante el siglo XX, considerando el acceso creciente al voto, la participación de la mujer en la vida pública y el acceso a la educación y a la cultura, entre otros.','HI06  OA 07',1,6,3),(399,'Comparar diferentes visiones sobre el quiebre de la democracia en Chile, el régimen o dictadura militar y el proceso de recuperación de la democracia a fines del siglo XX, considerando los distintos actores, experiencias y puntos de vista, y el consenso actual con respecto al valor de la democracia.','HI06  OA 08',1,6,3),(400,'Explicar y dar ejemplos de aspectos que se mantienen y aspectos que han cambiado o se han desarrollado en la sociedad chilena a lo largo de su historia.','HI06  OA 09',1,6,3),(401,'Identificar elementos constitutivos del territorio nacional, considerando la localización de Chile en el mundo y su carácter tricontinental.','HI06  OA 10',1,6,3),(402,'