n común.','HI06  OA 18',1,6,3),(410,'Proponer y fundamentar distintas formas en que la sociedad puede proteger a las personas de situaciones en las que no se respetan sus derechos.','HI06  OA 19',1,6,3),(411,'Demostrar actitudes cívicas con acciones en su vida diaria, como: respetar a todas las personas (ejemplos: actuar considerando la igualdad de derechos, escuchar respetuosamente opiniones distintas, etc.); contribuir a la buena convivencia (ejemplos: proponer posibles soluciones frente a un problema, usar el diálogo para plantear ideas a sus pares, alcanzar acuerdos, cooperar activamente en el logro de metas comunes, etc.); actuar con honestidad y responsabilidad (ejemplos: hablar con la verdad, actuar de acuerdo a sus convicciones y de las responsabilidades que se deriven, cumplir las responsabilidades asumidas, evitar la copia textual y el plagio, etc.); cuidar y valorar el patrimonio y el medioambiente (ejemplos: impulsar y participar en campañas de reciclaje, realizar acciones en la casa y en la escuela para ahorrar luz, agua y gas, etc.).','HI06  OA 20',1,6,3),(412,'Trabajar en equipo de manera efectiva para llevar a cabo una investigación u otro proyecto, asignando y asumiendo roles, cumpliendo las responsabilidades asignadas y los tiempos acordados, escuchando los argumentos de los demás, manifestando opiniones fundamentadas y llegando a un punto de vista común.','HI06  OA 21',1,6,3),(413,'Participar en su comunidad, tomando parte en elecciones para una directiva de curso, evaluando las propuestas realizadas por los diferentes aspirantes y considerando la importancia de elegir personas responsables.','HI06  OA 22',1,6,3),(414,'Participar, mediante acciones concretas, en proyectos que impliquen aportes dentro de la escuela, la comunidad y la sociedad, como voluntariado y ayuda social, entre otros, ateniéndose a un plan y un presupuesto.','HI06  OA 23',1,6,3),(415,'Opinar y argumentar con fundamentos sobre temas de la asignatura u otros.','HI06  OA 24',1,6,