ia de potencial eléctrico en un conductor, refiriéndose a dispositivos tecnológicos que la proporcionan. ','FI4M OA 03',1,12,4),(997,'Explicar que la corriente eléctrica es el flujo de carga eléctrica en un medio material, las circunstancias en que se produce, cómo se mide, los tipos de corrientes que existen y a qué corresponde su sentido. ','FI4M OA 04',1,12,4),(998,'Procesar e interpretar datos para demostrar la ley de Ohm y aplicarla en circuitos eléctricos resistivos simples y con resistencias eléctricas en serie y en paralelo.','FI4M OA 05',1,12,4),(999,'Utilizar las relaciones entre corriente eléctrica, resistencia eléctrica, voltaje, potencia eléctrica y energía eléctrica, reconociendo formas de usarla eficientemente.','FI4M OA 06',1,12,4),(1000,'Describir características generales de un imán, del campo magnético de la Tierra y de instrumentos como la brújula. ','FI4M OA 07',1,12,4),(1001,'Asociar el campo magnético que existe alrededor de un conductor eléctrico con la corriente eléctrica que porta, explicando algunos desarrollos tecnológicos como el electroimán. ','FI4M OA 08',1,12,4),(1002,'Describir el funcionamiento de motores de corriente continua y generadores eléctricos como consecuencia de la interacción entre una espira y un campo magnético.','FI4M OA 09',1,12,4),(1003,'Describir el núcleo atómico y algunas de sus propiedades','FI4M OA 10',1,12,4),(1004,'Describir las fuerzas al interior del núcleo atómico y algunas consecuencias, como la estabilidad de la materia.','FI4M OA 11',1,12,4),(1005,'Describir el origen y la evolución del universo considerando las teorías más aceptadas por la comunidad científica. ','FI4M OA 12',1,12,4),(1006,'Describir los procesos gravitacionales y nucleares que ocurren en las estrellas, explicando la emisión de radiación y la nucleosíntesis. ','FI4M OA 13',1,12,4);
